INSERT INTO `conteudo` (`id`, `titulo`, `conteudo`, `url`, `conteudotipo_id`, `pasta_id`, `usuario_id`, `contratante_id`, `criado`, `externalid`, `atualizado`, `inativo`, `excluido`, `subtitulo`) VALUES
('4028808f5ecde7af015ecdef30410005', 'Sobre', '<p><strong>Gestores com experi&ecirc;ncia no mercado imobili&aacute;rio de&nbsp;</strong><strong>Bento Gon&ccedil;alves e Porto Alegre</strong></p>\n<p><br /> Estamos cientes que a viv&ecirc;ncia no mercado imobili&aacute;rio ensina que em todo investimento a longo prazo &eacute; necess&aacute;rio haver confian&ccedil;a e qualidade. A seriedade com a qual trabalhamos com nossos clientes faz parte de nossa trajet&oacute;ria h&aacute; mais de 25 anos mercado imobili&aacute;rio, fornecendo seguran&ccedil;a e conforto, desde a prospec&ccedil;&atilde;o at&eacute; o p&oacute;s-venda. <img class="pull-right" src="api/arquivo/getFile/402880eb5eedb3e4015eedb85dce000a" width="423" height="320" /><br /> <br /> "Nosso diferencial &eacute; a qualidade no atendimento. Nosso dever &eacute; aconselhar&nbsp; os clientes no melhor investimento a ser realizado, seja para fam&iacute;lias, estudantes e profissionais em ascens&atilde;o", afirma o gestor de im&oacute;veis Rudimar Zini.<br /> <br /> <strong>Parcerias importantes para o cliente</strong> &nbsp;<br /> <br /> A parceria que viemos construindo com o mercado &eacute; importante n&atilde;o somente para a evolu&ccedil;&atilde;o da empresa, mas tamb&eacute;m para entregar vantagens ao nosso cliente. Estamos associados &agrave; Rede Ga&uacute;cha de Im&oacute;veis, uma das mais s&oacute;lidas&nbsp; redes de im&oacute;veis no sul do pa&iacute;s, que entre as vantagens, permite o cliente anunciar um im&oacute;vel para venda em todas as imobili&aacute;rias associadas &agrave; rede. <br /> <br /> Tamb&eacute;m fazemos parte da Rede Imobili&aacute;ria&nbsp; Bento Gon&ccedil;alves, que re&uacute;ne corretores e propriet&aacute;rio de imobili&aacute;rias do munic&iacute;pio a trabalhar em conjunto desde 1998, com o prop&oacute;sito de vender im&oacute;veis exclusivos em parceria. A rede trabalha de forma exclusiva atualmente com 14 empresas associadas. <br /> <br /> <strong>Rudimar Zini, Gestor de Investimento Imobili&aacute;rios</strong><br /> <br /> Rudimar Antonio Zini, &eacute; gestor de im&oacute;veis com forma&ccedil;&atilde;o superior em Gest&atilde;o Imobili&aacute;ria e em Administra&ccedil;&atilde;o de Empresas, pela Universidade de Caxias do Sul. Inscrito no CRECI n&uacute;mero 16.963 - iniciou suas atividades no ramo imobili&aacute;rio em 1987, e desde ent&atilde;o vem se especializando na comercializa&ccedil;&atilde;o de im&oacute;veis novos e usados nas cidades de Bento Gon&ccedil;alves e Porto Alegre. <br /> <br /> Em 1998, iniciou uma nova etapa, ingressando no mercado imobili&aacute;rio de Porto Alegre, fazendo parcerias com empresas comprovadamente id&ocirc;neas e com um passado de sucesso, e atendendo a clientes de Bento Gon&ccedil;alves e regi&atilde;o com um atendimento diferenciado, dando acompanhamento durante as obras e com plant&otilde;es nos fins de semana para que o cliente visite o seu futuro im&oacute;vel com mais tranquilidade. <br /> <br /> Integrante da Rede Imobili&aacute;ria Bento Gon&ccedil;alves, sendo seu presidente na gest&atilde;o 2003/2004, 2006/2007, e 2010/2011. Tamb&eacute;m integrante da Rede Ga&uacute;cha de Im&oacute;veis, sendo vicepresidente na gest&atilde;o 2010/2011.<br /> <br /> Nosso escrit&oacute;rio conta agora, tamb&eacute;m, com o servi&ccedil;o de correspondente banc&aacute;rio. Um servi&ccedil;o personalizado onde uma profissional especializada na &aacute;rea de financiamentos imobili&aacute;rios vai auxiliar as pessoas que precisam financiamento imobili&aacute;rio de maneira &aacute;gil e correta na comprova&ccedil;&atilde;o da sua renda, e na montagem de todo o processo para o financiamento do im&oacute;vel escolhido. <br /><br /> O comprador do im&oacute;vel n&atilde;o ficar&aacute; desamparado no per&iacute;odo entre a compra do im&oacute;vel e o financiamento, e&nbsp; ter&aacute;, durante o per&iacute;odo, todo o suporte para que no momento do financiamento no banco o processo esteja todo montado e pronto para an&aacute;lise do banco. <br /><br /> Trabalhamos junto &agrave;s construtoras da mesma maneira, assim as construtoras ter&atilde;o seus clientes em dia com suas rendas para que na hora do financiamento eles estejam com sua renda comprovada e assim, as construtoras possam fechar o custo da obra sem nenhum problema.</p>\n<p>Antes do financiamento:</p>\n<ul>\n<li>Simula&ccedil;&atilde;o do financiamento para saber o que comprar com seguran&ccedil;a;</li>\n<li>An&aacute;lise da sua renda;</li>\n<li>Assessoria na comprova&ccedil;&atilde;o da renda;</li>\n<li>Apoio e assessoria desde a escolha do seu im&oacute;vel at&eacute; o financiamento;</li>\n</ul>\n<p>No momento do financiamento:</p>\n<ul>\n<li>Simula&ccedil;&atilde;o do seu financiamento;</li>\n<li>Calculo das taxas que ter&aacute; durante o financiamento;</li>\n<li>Recolhimento da documenta&ccedil;&atilde;o necess&aacute;ria;</li>\n<li>Abertura de conta;</li>\n<li>Acompanhamento na assinatura do contrato;</li>\n<li>Acompanhamento no Registro de Im&oacute;veis;</li>\n<li>P&oacute;s venda.</li>\n</ul>', 'sobre', '4028808f5ecdd92c015ecddf6fd20003', '4028808f5ecde7af015ecdef30410004', 'teste', 'xlabi', '2017-10-05 15:07:56', NULL, '2017-10-05 15:07:56', 0, 0, 'Sobre a Empresa'),
('402880925ef19b88015ef1be68960002', 'Google', '<p>texto texto texto texto texto texto texto</p>', 'parceiros', '402880925ef19b88015ef1bc83e80000', '402880925ef19b88015ef1be68960001', 'teste', 'xlabi', '2017-10-06 09:54:02', NULL, '2017-10-06 09:54:02', 0, 0, 'Buscador'),
('402880eb5eedd416015eede62fc70002', 'Adriel Cordazzo', '<p>"Farei o poss&iacute;vel para encontrar o melhor im&oacute;vel para voc&ecirc; e sua fam&iacute;lia!"</p>\n<p><span class="fa fa-phone"></span>&nbsp; 54 9 9944 5566</p>\n<p><span class="fa fa-envelope-o"></span>&nbsp; adriel@imoveisrudimarzini.com.br</p>', 'colaboradores', '402880eb5eedd416015eeddd5a900000', '402880eb5eedd416015eede62fc50001', 'teste', 'xlabi', '2017-10-05 15:57:19', NULL, '2017-10-05 15:57:19', 0, 0, 'Corretor'),
