('402880eb5f24e5d3015f24f4b9780013', 'Rua Luiz Casemiro Frâncio ', '129', NULL, NULL, 'Mais uma garantia para você e sua família poderem desfrutar uma vida de conquistas com todo o prazer. Apartamento com 106,92m² de área privativa, ensolarado (leste, norte, oeste), com três dormitórios  uma suíte (norte) com sacada, dois dormitórios de solteiro (norte), living para dois ambientes com sacada fechada (oeste), circulação, banheiro social, cozinha (leste), área de serviço (leste), quatro vagas na garagem (dois boxes duplos). Edifício exclusivamente residencial, com dois apartamentos por andar, sem elevador, localizado em loteamento de alta valorização e junto à belas residências. ', 'DesocupaÃ§Ã£o apÃ³s a entrega do EdifÃ­cio Le Quartier.\r\n\r\n', 349580.9, 0, 0, 125.35, 4, 1, 1, 2, NULL, NULL, 1, '-29.1857065593793', '-51.512208108815', NULL, '95700-000', NULL, NULL, NULL, 0, NULL, NULL, '402880eb5ef3599a015ef35ac3d10002', '402880eb5f24e5d3015f24f4b9770012', '402880eb5f24e5d3015f24f4b913000f', '402880eb5f24e5d3015f24f2cf4f0002', '402880eb5f24e5d3015f24f2cf260001', '402880eb5f24e5d3015f24f2cecf0000', '402880eb5f24e5d3015f24f4b8c3000d', '402880eb5f24e5d3015f24f4b8e9000e', NULL, NULL, '402880eb5ef3599a015ef35ac3b00000', '2017-10-17 09:37:32', '13', '2017-10-17 09:37:32', 0, 0, '  ', 5, NULL, NULL, '402880eb5f24e5d3015f24f4b9550011', 'http://www.google.com.br'),
('402880eb5f24e5d3015f24f4bb2d001b', 'Distrito Industrial São Valentim 00', '00', NULL, NULL, 'Dois pavilhões novos, com 630m² cada um, de alvenaria e concreto, telhas de aluzinco, estacionamento frontal, 300 metros de área livre nos fundos, com Habite-se, PPCI, iluminação trifásica, piso industrial de 14 centímetros de concreto especial para peso, pé direito de 6 metros de altura, portão de 5 metros de altura, um escritório e três banheiros em cada pavilhão. Terreno de 29x69. Pavilhões desocupados. \r\n', 'Aceita imÃ³veis como parte de pagamento.', 1800000, 0, 0, 0, 0, 6, 0, 0, NULL, NULL, 1, '', '', NULL, '95700-000', NULL, NULL, NULL, 0, NULL, '', '402880eb5ef3599a015ef35ac3d10002', '402880eb5f24e5d3015f24f4bb2d001a', '402880eb5f24e5d3015f24f4bafc0017', '402880eb5f24e5d3015f24f4ba670014', '402880eb5f24e5d3015f24f2cf260001', '402880eb5f24e5d3015f24f2cecf0000', '402880eb5f24e5d3015f24f4bab40015', '402880eb5f24e5d3015f24f4bad40016', NULL, NULL, '402880eb5ef3599a015ef35ac3b00000', '2017-10-16 09:32:19', '16', '2017-10-16 09:32:19', 0, 0, '  ', 6, NULL, 0, '402880eb5f24e5d3015f24f4bb190019', NULL),
('402880eb5f24e5d3015f24f4bcfc0020', 'Linha São Valentim', '', NULL, NULL, 'Área rural em São Valentin, de 60,00 x 105,00, totalmente plana, cercada, com luz e água.\r\nPlantio de árvores frutíferas como laranjeiras, bergamoteiras, macieiras, pessegueiros, kiwizeiros, caquizeiros e também 520 videiras das variedades itália, rubi e perlona clara e morena (sem sementes).\r\nÁrea muito bem cuidada, com parreirais bem tratadas e podadas.\r\nÁrea própria para construção de casa, em local tranquilo, a poucos metros do calçamento e com acesso por estrada asfaltada até o centro da cidade.', '', 690000, 0, 0, 0, 0, 0, 0, 0, NULL, NULL, 1, '', '', NULL, '95700-000', NULL, NULL, NULL, 0, NULL, '', '402880eb5ef3599a015ef35ac3d10002', '402880eb5f24e5d3015f24f4bcfc001f', '402880eb5f24e5d3015f24f4bca6001e', '402880eb5f24e5d3015f24f4ba670014', '402880eb5f24e5d3015f24f2cf260001', '402880eb5f24e5d3015f24f2cecf0000', '402880eb5f24e5d3015f24f4bc26001c', '402880eb5f24e5d3015f24f4bc6a001d', NULL, NULL, '402880eb5ef3599a015ef35ac3b00000', '2017-10-16 09:32:19', '39', '2017-10-16 09:32:19', 0, 0, '  ', 7, NULL, 0, '402880eb5f24e5d3015f24f4bb190019', NULL),
('402880eb5f24e5d3015f24f4be9e0026', 'Linha Palmeiro', '', NULL, NULL, 'Pavilhão industrial, desocupado, na Linha Palmeiro, em São Pedro, Bento Gonçalves,  construido em terreno de 3.450m². Pavilhão com 2.068m² de área construida, com rampa de acesso para caminhões, casa de força com 7,42m², refeitório (50,21m²), dois dormitórios (11,20m² e 11,40m²) e um banheiro para atender os dormitórios e refeitório, escritório com 20,60m² divido em duas salas e banheiro, depósito de 17,39m², luz trifásica, telhado com estrutura metálica e telhas de zinco, e um grande pavilhão dividido em sala de máquinas(refrigeração) com 41,29m² e 120m² de circulação, mais 10 salas, com dois banheiros e uma circulação comum de 171,84m², assim distribuidas  Câmara 01 com 111,74m²; Câmara 02 com 111,15m²; Câmara 03 com 102,19m²; Câmara 04 com 101,65m²; Câmara 05 com 110,78m²; Câmara 06 com 110,29m²; Sala de Classificação de Frutas com 296,34m²; Câmara de Resfriamento com 214,60m²; Sala com 112,00m² que não está na planta; Sala com 24,00m² que não está na planta. Acesso por asfalto até a frente do imóvel. À 15 Km do centro de Bento Gonçalves e a 1.300ms da RS 448 que liga à Farroupilha. Imóvel próprio para armazenagem de frutas, e viável para transportadora e industrias de outras atividades.', '', 2130000, 0, 0, 0, 0, 4, 0, 0, NULL, NULL, 0, '', '', NULL, '95700-000', NULL, NULL, NULL, 0, NULL, '', '402880eb5ef3599a015ef35ac3d10002', '402880eb5f24e5d3015f24f4be9e0025', '402880eb5f24e5d3015f24f4be480024', '402880eb5f24e5d3015f24f4bdc20021', '402880eb5f24e5d3015f24f2cf260001', '402880eb5f24e5d3015f24f2cecf0000', '402880eb5f24e5d3015f24f4bdfb0022', '402880eb5f24e5d3015f24f4be1b0023', NULL, NULL, '402880eb5ef3599a015ef35ac3b00000', '2017-10-16 09:32:20', '42', '2017-10-16 09:32:20', 0, 0, '  ', 8, NULL, 0, '402880eb5f24e5d3015f24f4bb190019', NULL),
('402880eb5f24e5d3015f24f4c000002c', 'Rua Treze de Maio ', '1158', NULL, NULL, 'Apartamento novo, desocupado, pronto para morar, com dois dormitórios (sendo uma suíte) com sacada (oeste), sala para dois ambientes com sacadão e churrasqueira (oeste), cozinha, área de serviço, banheiro social, garagem para um automóvel, piso laminado em todas as peças. Espera para calefação em todos os ambientes. Posição solar oeste sul. \r\n\r\nEdifício com elevador, bem localizado, ao lado do supermercado Imec, e próximo a todos os recursos (Shopping, restaurantes, bancos, cinemas, supermercados). \r\n', '', 387000, 0, 0, 113.48, 1, 0, 0, 0, NULL, NULL, 1, '', '', NULL, '95700-000', NULL, NULL, NULL, 0, NULL, '', '402880eb5ef3599a015ef35ac3d10002', '402880eb5f24e5d3015f24f4c000002b', '402880eb5f24e5d3015f24f4bfe9002a', '402880eb5f24e5d3015f24f4bf6b0027', '402880eb5f24e5d3015f24f2cf260001', '402880eb5f24e5d3015f24f2cecf0000', '402880eb5f24e5d3015f24f4bfac0028', '402880eb5f24e5d3015f24f4bfcc0029', NULL, NULL, '402880eb5ef3599a015ef35ac3b00000', '2017-10-16 09:32:20', '44', '2017-10-16 09:32:20', 0, 0, '  ', 9, NULL, 0, '402880eb5f24e5d3015f24f4bb190019', NULL),
