('402880eb5f24e5d3015f24f4c377003a', 'Travessa Minas Gerais  ', '', NULL, NULL, 'Preste atenção à minha beleza, à minha requintada ambiguidade, olhe-me da cabeça aos pés, não haverá dois assim!\r\n\r\nUma obra de arte é um privilégio para apenas 16 famílias. Apartamento de 126 m² de área privativa, três dormitórios, sendo uma suíte com sacada, amplo living para dois ambientes com lareira e sacada integrada fechada com vidro, copa cozinha americana com churrasqueira, área de serviço, banheiro social, lavabo, piso porcelanato na área social e piso laminado nos dormitórios, espera para ar condicionado tipo split, espera para calefação, paredes externas duplas, duas vagas na garagem. Comemore em grande estilo, edifício com salão de festas decorado e mobiliado no mezanino, e um amplo terraço com linda vista da cidade. \r\n\r\nUma obra exclusiva, totalmente residencial, com todos os apartamentos de frente e ensolarados, sendo dois apartamentos de três dormitórios por andar. A fachada externa com materiais nobres, revestida em granito e pastilhas, o hall de entrada com pé direito duplo, esquadrias de PVC para vidros duplos, guarita de segurança, elevador, aquecimento solar central com complemento a gás, medidores individuais de água e gás. Venha viver a uma quadra do centro da Cidade, e desfrutar das características de um bairro residencial, com tranquilidade, charme e muito conforto. Imagine você poder deixar seu carro na garagem e desfrutar de toda infraestrutura do Centro, supermercados, shopping center, academias, lojas, bancos, restaurantes. Tudo a apenas uma quadra do Le Quartier Charm Residence.', '', 0, 0, 0, 0, 2, 0, 1, 2, NULL, NULL, 1, '', '', NULL, '95700-000', NULL, NULL, NULL, 1072, NULL, '', '402880eb5ef3599a015ef35ac3d10002', '402880eb5f24e5d3015f24f4c3770039', '402880eb5f24e5d3015f24f4c34f0038', '402880eb5f24e5d3015f24f4c2bf0035', '402880eb5f24e5d3015f24f2cf260001', '402880eb5f24e5d3015f24f2cecf0000', '402880eb5f24e5d3015f24f4c2ee0036', '402880eb5f24e5d301