('402880eb5f24e5d3015f24f4c4bd003f', 'Travessa Minas Gerais ', '', NULL, NULL, 'Olhe para mim, eu sou o mais belo do bairro. Sou o mais amado ... Quando elas me veem, sentem-se enfeitiçadas!\r\n\r\nAssim é o Le Quartier Charm Residence. Uma obra de arte em construção a uma quadra do Centro da cidade. Apartamento com 147 m² de área privativa, com três dormitórios, sendo uma suíte (26,12 m²), amplo living (28,29 m²) para três ambientes com lareira e sacada integrada fechada com vidro, sacada externa (3,25 m²), gabinete escritório (4,48 m²), copa cozinha americana (16,21 m²) com churrasqueira, área de serviço (5,61 m²), banheiro social, lavabo, piso porcelanato na área social e piso laminado nos dormitórios, paredes externas duplas, espera para ar condicionado tipo split, espera para calefação, duas vagas na garagem. \r\n\r\nComemore em grande estilo, edifício com salão de festas decorado e mobiliado no mezanino com terraço, e uma vista linda da cidade, a partir do primeiro andar de apartamentos. Uma obra exclusiva, totalmente residencial, com somente dezesseis apartamentos, todos de frente e ensolarados, sendo dois apartamentos de três dormitórios por andar. Fachada externa revestida em granito e pastilhas, hall de entrada com pé direito duplo, esquadrias de PVC para vidros duplos, guarita de segurança, elevador, aquecimento solar central com complemento a gás, medidores individuais de água e gás. Venha viver no centro da Cidade, e poder desfrutar das características de um bairro residencial, com tranquilidade, charme e muito conforto, com tudo ao seu alcance, escolas, supermercado, shopping, academias, lojas, bancos, e tudo sem sair com seu carro da garagem. \r\n\r\nValor referente ao apartamento 102 e box 13 (duplo).', '', 0, 0, 0, 216.75, 2, 0, 1, 2, NULL, NULL, 1, '-29.162294526625818', '-51.519981249737555', NULL, '95700-000', NULL, NULL, NULL, 1218.181, NULL, '', '402880eb5ef3599a015ef35ac3d10002', '402880eb5f24e5d3015f24f4c4bd003e', '402880eb5f24e5d3015f24f4c49