('402880eb5f24e5d3015f24f4c6740045', 'Rua Tannat, Loteamento Alto das Videiras', 'Lote nº 74', NULL, NULL, 'Terreno de 34 x 80, frente norte, totalmente plano, no loteamento Alto das Videiras, cercado por vinhedos, entre a natureza exuberante e as melhores vinícolas do País, seu lazer tem outra qualidade. \r\n\r\nMais de 115.000 m² de vegetação nativa preservada. Lazer com praça de 12 mil m² com mais de 100 araucárias, trilha ecológica com cascata, lago e vegetação, playground, solarium, 38 mil m² de recreação. \r\n\r\nInfra-estrutura de acesso ao loteamento com ruas amplas e totalmente pavimentadas com paralelepípedos em basalto, típico da região, passeios com 3 metros de largura arborizado com espécies nativas e frutíferas, rede de telefonia e internet, rede elétrica com iluminação pública, abastecimento de água potável, rede de esgotamento pluvial. Segurança com portaria e monitoramento 24 horas, controle de segurança interligado à central de segurança externa, viaturas de segurança, circuito interno de TV nas ruas.\r\n\r\nUm refúgio encantador de alto padrão, cercado de verde por todos os lados e com uma deslumbrante vista do Vale dos Vinhedos, belas araucárias, o delicado aroma do ar puro, os deliciosos labirintos entre as vinhas. Este é o ambiente ideal para você cultivar o seu bem-estar. Apenas 90 minutos de Porto Alegre e 10 minutos do centro de Bento Gonçalves.', '', 450000, 0, 0, 0, 0, 0, 0, 0, NULL, NULL, 1, '', '', NULL, '95700-000', NULL, NULL, NULL, 0, NULL, '', '402880eb5ef3599a015ef35ac3d10002', '402880eb5f24e5d3015f24f4c6740044', '402880eb5f24e5d3015f24f4c6280043', '402880eb5f24e5d3015f24f4c5680040', '402880eb5f24e5d3015f24f2cf260001', '402880eb5f24e5d3015f24f2cecf0000', '402880eb5f24e5d3015f24f4c5a30041', '402880eb5f24e5d3015f24f4c5e50042', NULL, NULL, '402880eb5ef3599a015ef35ac3b00000', '2017-10-16 09:32:22', '93', '2017-10-16 09:32:22', 0, 0, '  ', 13, NULL, 0, '402880eb5f24e5d3015f24f4c1f50032', NULL),
