('402880eb5f24e5d3015f24f4dd890096', 'Rua Pernambuco', '250', NULL, NULL, 'Ambientes integrados, pé direito alto e grandes aberturas são características marcantes desta arquitetura. \r\n\r\nLoft com 54,51 m² privativos, duplex living, cozinha com churrasqueira, lavabo e área de serviço, escada de acesso para o mezanino com suíte. Um box de garagem. Moradia confortável, aconchegante e personalizada. \r\n\r\nHoje, o conceito de loft está muito mais ligado a um estilo de vida do que a uma questão estética. Uma opção para quem busca um espaço prático, original e cheio de estilo de viver. \r\n\r\nEdifício com elevador, esquadrias externas em alumínio pintado, vidros laminados, aquecimento de água central, os ambientes terão esperas de ar condicionado. Muito bem localizado próximo ao Centro da Cidade e todos os recursos que ele oferece, como supermercados, academias, Shopping Center, bancos, lojas.', '', 270000, 0, 0, 0, 1, 0, 0, 1, NULL, NULL, 1, '', '', NULL, '95700-000', NULL, NULL, NULL, 0, NULL, '', '402880eb5ef3599a015ef35ac3d10002', '402880eb5f24e5d3015f24f4dd880095', '402880eb5f24e5d3015f24f4dd710094', '402880eb5f24e5d3015f24f4c2bf0035', '402880eb5f24e5d3015f24f2cf260001', '402880eb5f24e5d3015f24f2cecf0000', '402880eb5f24e5d3015f24f4dd2b0092', '402880eb5f24e5d3015f24f4dd550093', NULL, NULL, '402880eb5ef3599a015ef35ac3b00000', '2017-10-16 09:32:28', '174', '2017-10-16 09:32:28', 0, 0, '  ', 28, NULL, 0, '402880eb5f24e5d3015f24f4c1f50032', NULL),
('402880eb5f24e5d3015f24f4dee4009b', 'Rua Olavo Bilac', '830', NULL, NULL, 'Bairro São Bento, infra estrutura diversificada, espaço de laser e caminhadas, Shopping Center, supermercado, padaria, Bancos, Cinema e ao lado de um corredor gastronômico variado. O lugar ideal para trazer a sua família e desfrutar das facilidades que a localização oferece. \r\n\r\nCobertura duplex com vista panorâmica, são 183,69 m² de área privativa. \r\n\r\nPavimento inferior: Duas suítes, living para três ambientes com sacada integrada, espera para lareira com dutos para todos os ambientes, cozinha americana com churrasqueira, área de serviço, banheiro social, lavabo, espera para split em todas as dependências, gesso em todo o apartamento, piso laminado nos dormitórios com rodapés de 9 cm " a escolher " e piso porcelanato no living e área social com rodapés de 12 cm. \r\n\r\nPavimento superior: Ampla área integrada com 53,18 m², living com lareira, cozinha americana com churrasqueira, lavabo, terraço com deck (23,83 m²) e sauna, isolamento térmico, acústico e resistente ao fogo.\r\n\r\nEdifício com duas torres,  esquadrias em PVC, guarita de segurança 24 horas, amplo salão de festas com duas cozinhas equipadas e mobiliadas, churrasqueira, lareira canadense e forno para pizza. Na parte externa piscina com deck e banheiro social. Terceiro pavimento  um espaço para brinquedoteca, fitness equipado e apartamento para zelador. \r\n\r\nValor referente ao apartamento nº 1201 Torre Siena - Posição solar Leste - Duas vagas de garagem + depósito " Opção para adquirir mais vagas "; \r\n', '', 0, 0, 0, 271.25, 2, 0, 2, 0, NULL, NULL, 1, '', '', 1, '95700-000', NULL, NULL, NULL, 1508.941, NULL, '', '402880eb5ef3599a015ef35ac3d10002', '402880eb5f24e5d3015f24f4dee4009a', '402880eb5f24e5d3015f24f4deb50099', '402880eb5f24e5d3015f24f4bf6b0027', '402880eb5f24e5d3015f24f2cf260001', '402880eb5f24e5d3015f24f2cecf0000', '402880eb5f24e5d3015f24f4de640097', '402880eb5f24e5d3015f24f4de880098', NULL, NULL, '402880