('402880eb5f24e5d3015f24f4e03f00a0', 'Rua Olavo Bilac', '830', NULL, NULL, 'São 90,95 m² de área privativa, duas suítes, living para dois ambientes com sacada integrada e espera para lareira de alto rendimento com dutos para todos os ambientes, lavabo, cozinha americana com churrasqueira e espera para coifa, área de serviço e banheiro social. Espera para split em todas as dependências, gesso em todo o apartamento, piso laminado nos dormitórios com rodapés de 9 cm " a escolher ", piso porcelanato no living e área social com rodapés de 12 cm e esquadrias de PVC. Construído com blocos de concreto celular, um produto especial para o nosso clima com isolamento térmico, acústico, e resistente ao fogo. \r\n\r\nEdifício com duas torres, quatro apartamentos por andar, dois elevadores por torre, guarita de segurança 24 horas, amplo salão de festas mobiliado e decorado com duas cozinhas, churrasqueira, lareira canadense, espaço gourmet e forno para pizza com acesso a parte externa com piscina. \r\n\r\nLocalização privilegiada no Bairro São Bento, à duas quadras da Avenida Planalto com seu comercio diversificado, próximo a todos os recursos importantes, como supermercados, restaurantes, Shopping L`América, colégios, farmácias, cinemas, academias, hotéis, e o prazer de estar na região mais charmosa e valorizada da cidade, com acesso fácil para o Centro e diversos pontos da Cidade.\r\n\r\nValor referente ao apartamento n° 1203 Torre Firenze - Posição solar Oeste - Duas vagas de garagem + depósito.\r\n', '', 0, 0, 0, 141.11, 2, 0, 2, 0, NULL, NULL, 1, '', '', 1, '95700-000', NULL, NULL, NULL, 880.941, NULL, '', '402880eb5ef3599a015ef35ac3d10002', '402880eb5f24e5d3015f24f4e03f009f', '402880eb5f24e5d3015f24f4e008009e', '402880eb5f24e5d3015f24f4bf6b0027', '402880eb5f24e5d3015f24f2cf260001', '402880eb5f24e5d3015f24f2cecf0000', '402880eb5f24e5d3015f24f4dfd0009c', '402880eb5f24e5d3015f24f4dff0009d', NULL, NULL, '402880eb5ef3599a015ef35ac3b00000', '2017-10-16 09:32:28', '218', '2017-10-1