('402880eb5f24e5d3015f24f4e1d200a5', 'Rua Paulo Puerari', '141', NULL, NULL, 'Apartamento com dois dormitórios, living, cozinha, área de serviço e banheiro. Piso laminado e cerâmico, churrasqueira, uma vaga na garagem. Com tubulação para água quente, espera para split, portas internas laminadas, tubulação para tv à cabo e internet, gás central e medidor de água individuais, aberturas externas em alumínio.\r\n\r\nPosição solar leste/norte.\r\n\r\nEdifício cercado, com dois elevadores, portão eletrônico no acesso de veículos, salão de festas entregue mobiliado, próximo a mercado, escola, praça, e ao Centro da Cidade e todas facilidades que ele oferece.', '', 194990, 6, 0, 0, 1, 0, 0, 2, NULL, NULL, 1, '', '', 1, '95700-000', NULL, NULL, NULL, 0, NULL, '', '402880eb5ef3599a015ef35ac3d10002', '402880eb5f24e5d3015f24f4e1d200a4', '402880eb5f24e5d3015f24f4e1b100a3', '402880eb5f24e5d3015f24f4d2b7006c', '402880eb5f24e5d3015f24f2cf260001', '402880eb5f24e5d3015f24f2cecf0000', '402880eb5f24e5d3015f24f4e15e00a1', '402880eb5f24e5d3015f24f4e18900a2', NULL, NULL, '402880eb5ef3599a015ef35ac3b00000', '2017-10-16 09:32:29', '230', '2017-10-16 09:32:29', 0, 0, '  ', 31, NULL, 0, '402880eb5f24e5d3015f24f4c1f50032', NULL),
