('402880eb5f24e5d3015f24f4e6ce00bc', 'Rua Assis Brasil 240 Cobertura + um box de garagem', '240', NULL, NULL, 'Cobertura duplex, andar alto, com dois dormitórios, dois banheiros, duas sacadas, cozinha grande, living, mezanino escritório com pé direito duplo, depósito. Móveis sob medida em todo o apartamento.\r\nFicam também  dois aparelhos de ar condicionad (split) de 12.000 BTUs, fogão tipo cook top, coifa, e forno elétrico Dellano, geladeira, máquina de lavar roupas. \r\nUm box de garagem. \r\nEdifício bem localizado, no Centro da Cidade, apenas uma quadra do Shopping Bento. \r\n', '', 350000, 6, 0, 110, 1, 0, 0, 0, NULL, NULL, 0, '', '', NULL, '95700-000', NULL, NULL, NULL, 0, NULL, '', '402880eb5ef3599a015ef35ac3d10002', '402880eb5f24e5d3015f24f4e6ce00bb', '402880eb5f24e5d3015f24f4e68800ba', '402880eb5f24e5d3015f24f4e62100b7', '402880eb5f24e5d3015f24f2cf260001', '402880eb5f24e5d3015f24f2cecf0000', '402880eb5f24e5d3015f24f4e65300b8', '402880eb5f24e5d3015f24f4e66d00b9', NULL, NULL, '402880eb5ef3599a015ef35ac3b00000', '2017-10-16 09:32:30', '242', '2017-10-16 09:32:30', 0, 0, '  ', 35, NULL, 0, '402880eb5f24e5d3015f24f4c1f50032', NULL),
('402880eb5f24e5d3015f24f4e81100c3', 'Rua Arthur Beltrami 136', '136', NULL, NULL, 'Casa de alvenaria construída em 1953 com 229,00 m², localizada no ponto central de Monte Belo do Sul, de esquina frente à praça e à  Igreja. No térreo, uma sala comercial. Na parte superior, quatro dormitórios, sala de estar, sala de jantar, cozinha, área de serviço e banheiro social. Uma vaga na garagem.\r\nTerreno com medições de 20 x 13 = 260 m².', '', 550000, 0, 0, 0, 1, 0, 0, 0, NULL, NULL, 1, '', '', NULL, '95718-000', NULL, NULL, NULL, 0, NULL, '', '402880eb5ef3599a015ef35ac3d10002', '402880eb5f24e5d3015f24f4e81000c2', '402880eb5f24e5d3015f24f4e7f000c1', '402880eb5f24e5d3015f24f4e78b00be', '402880eb5f24e5d3015f24f4e74a00bd', '402880eb5f24e5d3015f24f2cecf0000', '402880eb5f24e5d3015f24f4e7aa00bf', '402880eb5f24e5d3015f24f4e7cb00c0', NULL, NULL, '402880eb5ef3599a015ef35ac3b00000', '2017-10-16 09:32:30', '245', '2017-10-16 09:32:30', 0, 0, '  ', 36, NULL, 0, '402880eb5f24e5d3015f24f4c1f50032', NULL),
('402880eb5f24e5d3015f24f4e93500c9', 'Avenida Osvaldo Aranha', '303', NULL, NULL, 'Do alto se vê o horizonte. Desfrute desta vista espetacular, o lugar perfeito para você!\r\nLocalização ideal, na avenida Osvaldo Aranha, em bairro com infra-estrutura completa e facilidade no acesso. Acesso privativo de embarque e desembarque. Uma vista inigualável em todos os apartamentos. Sacadas fechadas integradas ao ambiente ganham espaço e garantem luminosidade para o apartamento.\r\nO Edifício Positano possui acabamentos em alto padrão com fachadas em pastilhas de porcelana. Ótima orientação solar.\r\nÁrea de lazer será entregue mobiliada, garagens com amplo espaço para circulação. O andar térreo é composto por hall de entrada, salão de festas, terraço com playground, fitness, guarita de segurança e box de garagem.\r\n\r\nSão quatro apartamentos por andar (sendo três com três dormitórios, e um com dois dormitórios, com suíte). Apartamentos com churrasqueira, espera para lareira a pellet, espera para split nas áreas sociais e dormitórios, esquadrias em alumínio ou pvc, vidros bronze (sendo que nos dormitórios serão termo-acústicos), forro de gesso em todos os ambientes, piso porcelanato nas áreas sociais e laminado nos dormitórios. Possibilidade de dois a quatro boxes e depósito por apartamento, medição de água, gás e luz individuais, tratamento acústico, dois elevadores alto padrão, gerador de energia exclusivo para elevadores e portões de garagem. \r\nMassa corrida em todo o apartamento, captação e reaproveitamento da água da chuva para fins de limpeza e jardim.\r\nEmpreendimento pronto em dezembro de 2017.\r\nPreço referente ao apartamento 301 de três dormitórios, sendo um suíte, com área privativa de 114,08 m² e boxes de garagem 2 (duplo+depósito) e 23 (simples).', '', 0, 0, 0, 216.98, 3, 0, 1, 2, NULL, NULL, 1, '', '', NULL, '95700-000', NULL, NULL, NULL, 856.61, NULL, '', '402880eb5ef3599a015ef35ac3d10002', '402880eb5f24e5d3015f24f4e93400c8', '402880eb5f24e5d3015f24f4e91a