('402880eb5f24e5d3015f24f4ea5800d0', 'Rua Sepé 3239 Apto', '3239', NULL, NULL, 'Um lugar especial, cheio de cores, sorrisos, fantasias, sonhos e muita diversão.\r\n\r\nApartamento no litoral, em Capão da Canoa, com dois dormitórios (sendo uma suíte), living para dois ambientes, cozinha com churrasqueira, banheiro social e área de serviço. Um box de garagem.\r\n\r\nEdifício localizado à 200 metros da praia, com dois elevadores, cobertura coletiva, apartamentos rebaixados em gesso, telhado verde, projeto sem vigas aparentes, espera para automação, sistemas eletrônicos de segurança, iluminação led nos corredores, medição de água individual, aquecimento a gás, áreas sociais mobiliadas. E para diversão completa da família, piscina com borda infinita, sala fitness, salão de festas, salão de jogos, playground e brinquedoteca. \r\n\r\nUm lugar para ser feliz, para se viver!', '', 265000, 0, 0, 0, 1, 0, 0, 0, NULL, NULL, 1, '', '', NULL, '95555-000', NULL, NULL, NULL, 0, NULL, '', '402880eb5ef3599a015ef35ac3d10002', '402880eb5f24e5d3015f24f4ea5800cf', '402880eb5f24e5d3015f24f4ea4300ce', '402880eb5f24e5d3015f24f4e9f300cb', '402880eb5f24e5d3015f24f4e9b700ca', '402880eb5f24e5d3015f24f2cecf0000', '402880eb5f24e5d3015f24f4ea0500cc', '402880eb5f24e5d3015f24f4ea2700cd', NULL, NULL, '402880eb5ef3599a015ef35ac3b00000', '2017-10-16 09:32:31', '250', '2017-10-16 09:32:31', 0, 0, '  ', 38, NULL, 0, '402880eb5f24e5d3015f24f4c1f50032', NULL),
