('402880eb5f24e5d3015f24f4ee0b00df', 'Avenida Osvaldo Aranha', '303', NULL, NULL, 'Do alto se vê o horizonte. Desfrute desta vista espetacular, o lugar perfeito para você!\r\nLocalização ideal, na avenida Osvaldo Aranha, em bairro com infra-estrutura completa e facilidade no acesso. Uma vista inigualável em todos os apartamentos. Acesso privativo de embarque e desembarque. Sacadas fechadas integradas ao ambiente ganham espaço e garantem luminosidade para o apartamento. \r\nO Edifício Positano possui acabamentos em alto padrão com fachadas em pastilhas de porcelana. Ótima orientação solar.\r\nÁrea de lazer será entregue mobiliada, garagens com amplo espaço para circulação. O andar térreo é composto por hall de entrada, salão de festas, terraço com playground, fitness, guarita de segurança e box de garagem.\r\n\r\nSão quatro apartamentos por andar (sendo três com três dormitórios, e um com dois dormitórios, com suíte). Apartamentos com churrasqueira, espera para lareira a pellet, espera para split nas áreas sociais e dormitórios, esquadrias em alumínio ou pvc, vidros bronze (sendo que nos dormitórios serão termo-acústicos), forro de gesso em todos os ambientes, piso porcelanato nas áreas sociais e laminado nos dormitórios. Possibilidade de dois a quatro boxes e depósito por apartamento, medição de água, gás e luz individuais, tratamento acústico, dois elevadores alto padrão, gerador de energia exclusivo para elevadores e portões de garagem. \r\nMassa corrida em todo o apartamento, captação e reaproveitamento da água da chuva para fins de limpeza e jardim.\r\nEmpreendimento pronto em dezembro de 2017. \r\nPreço referente ao apartamento 1203, de dois dormitórios, sendo um suíte, com área privativa de 86,84 m² e box 14 (duplo).', '', 0, 0, 0, 0, 2, 0, 1, 1, NULL, NULL, 1, '', '', NULL, '95700-000', NULL, NULL, NULL, 755, NULL, '', '402880eb5ef3599a015ef35ac3d10002', '402880eb5f24e5d3015f24f4ee0b00de', '402880eb5f24e5d3015f24f4edeb00dd', '402880eb5f24e5d3015f24f4e8a000c4'