('402880eb5f24e5d3015f24f4ef9b00e4', 'Rua Cavalheiro Horácio Mônaco', '60', NULL, NULL, 'Se viver em Bento Gonçalves é maravilhoso, morar perto de tudo é ainda melhor. São duas torres residenciais com apartamentos de até três dormitórios, com suíte, localização valorizada e perto de tudo o que a região central tem de melhor. É ter a praticidade de poder fazer simplesmente tudo a pé, cuidar da saúde e beleza, fazer compras, academia, floricultura, restaurantes, cafés, supermercados e escolas.\r\n\r\nO Empreendimento terá como características esquadrias em alumínio, medidores individuais de água e gás, revestimento externo em pastilhas e textura, gesso e massa corrida em todos os apartamentos, porcelanato no living, cozinha, área de serviço e banheiros, piso laminado nos dormitórios. Espera para Split no living, churrasqueira, sacada fechada em todos os apartamentos, salão de festas para cada torre de apartamentos, dois elevadores por torre.\r\n\r\nApartamento com 68,67 m² de área privativa, dois dormitórios (sendo um suíte) e um box de garagem + depósito.\r\n\r\nPrazo de entrega setembro de 2017.', '', 0, 0, 0, 0, 1, 0, 1, 1, NULL, NULL, 1, '', '', NULL, '95700-000', NULL, NULL, NULL, 463.557, NULL, '', '402880eb5ef3599a015ef35ac3d10002', '402880eb5f24e5d3015f24f4ef9b00e3', '402880eb5f24e5d3015f24f4ef6800e2', '402880eb5f24e5d3015f24f4e62100b7', '402880eb5f24e5d3015f24f2cf260001', '402880eb5f24e5d3015f24f2cecf0000', '402880eb5f24e5d3015f24f4ef0200e0', '402880eb5f24e5d3015f24f4ef4100e1', NULL, NULL, '402880eb5ef3599a015ef35ac3b00000', '2017-10-16 09:32:32', '256', '2017-10-16 09:32:32', 0, 0, '  ', 42, NULL, 0, '402880eb5f24e5d3015f24f4c1f50032', NULL),
