('402880eb5f24e5d3015f24f4f24c00ee', 'Rua Olavo Bilac ', '830', NULL, NULL, 'Para quem busca praticidade e privacidade, apartamento totalmente mobiliado e decorado com duas suítes, são 126,87 m² de área privativa, living para dois ambientes com sacada integrada e espera para lareira de alto rendimento com dutos para todos os ambientes, terraço na suíte principal, lavabo, cozinha americana com churrasqueira e espera para coifa, área de serviço e banheiro social. Espera para split em todas as dependências, gesso em todo o apartamento, piso laminado nos dormitórios com rodapés de 9 cm, piso porcelanato no living e área social com rodapés de 12 cm e esquadrias de PVC. Construído com blocos de concreto celular, um produto especial para o nosso clima, com isolamento térmico, acústico, e resistente ao fogo. \r\n\r\nEdifício com duas torres, quatro apartamentos por andar, dois elevadores por torre, guarita de segurança 24 horas, amplo salão de festas mobiliado e decorado com duas cozinhas, churrasqueira, lareira canadense, espaço gourmet e forno para pizza com acesso a parte externa com piscina. \r\n\r\nLocalização privilegiada no Bairro São Bento, à duas quadras da Avenida Planalto com seu comercio diversificado, próximo a todos os recursos importantes, como supermercados, restaurantes, Shopping L`América, colégios, farmácias, cinemas, academias, hotéis, e o prazer de estar na região mais charmosa e valorizada da cidade, com acesso fácil para o Centro e diversos pontos da Cidade.\r\n\r\nValor referente ao apartamento n° 402 Torre Siena " Decorado " - Duas vagas de garagem + depósito;\r\n', 'Apto 2 dorm condomÃ­nio em mÃ©dia R$ 350,00 + Ã¡gua + luz + gÃ¡s', 0, 0, 0, 181.98, 2, 0, 2, 0, NULL, NULL, 1, '', '', NULL, '95700-000', NULL, NULL, NULL, 1094.941, NULL, '', '402880eb5ef3599a015ef35ac3d10002', '402880eb5f24e5d3015f24f4f24b00ed', '402880eb5f24e5d3015f24f4f22700ec', '402880eb5f24e5d3015f24f4bf6b0027', '402880eb5f24e5d3015f24f2cf260001', '402880eb5f24e5d3015f24f2cecf0000