('402880eb5f24e5d3015f24f51598017a', '', '', NULL, NULL, 'Casa com aproximadamente 300,00 m² de área construída, no Loteamento Floresta, junto a outras belas residências em loteamento de alto padrão, terreno de 15 x 30 = 450,00 m².\r\n\r\nParte inferior: Amplo jardim com paisagismo e pergolado, quiosque com churrasqueira, garagem para dois carros com espaço aberto para mais dois carros. Sala de estar com dois ambientes, dividido com móvel vazado e sanca de gesso, piso de madeira, sala ampla com lareira, cozinha mobiliada com espaço para mesa de jantar, piso porcelanato, área de serviço ampla com porta para os fundos e acesso à garagem, lavabo mobiliado, suíte ampla.\r\n\r\nParte superior: Suíte mobiliada com sacada e vista para o vale, banheiro social, dormitório infantil, dormitório adulto, toda parte superior com piso laminado. Casa com aquecimento de água a gás, portão eletrônico, interfone e cerca elétrica.', 'PreÃ§o: R$ 850.000,00.\r\nAceita-se imÃ³vel de menor valor.\r\nImÃ³vel nÃ£o averbado.\r\nIptu: R$ 1.000,00\r\nCasa estÃ¡ no nome dos sogros do Henrique Hubner.', 850000, 0, 0, 0, 4, 0, 2, 3, NULL, NULL, 1, '-29.1696152', '-51.511736499999984', NULL, '95700-000', NULL, NULL, NULL, 0, NULL, '', '402880eb5ef3599a015ef35ac3d10002', '402880eb5f24e5d3015f24f515980179', '402880eb5f24e5d3015f24f515740178', '402880eb5f24e5d3015f24f5150b0175', '402880eb5f24e5d3015f24f2cf260001', '402880eb5f24e5d3015f24f2cecf0000', '402880eb5f24e5d3015f24f515350176', '402880eb5f24e5d3015f24f515580177', NULL, NULL, '402880eb5ef3599a015ef35ac3b00000', '2017-10-16 09:32:42', '345', '2017-10-16 09:32:42', 0, 0, '  ', 71, NULL, 0, '402880eb5f24e5d3015f24f4bb190019', NULL),
('402880eb5f24e5d3015f24f516e0017f', 'Rua Augusto Pasquali', '453', NULL, NULL, 'Morar no Botafogo é um privilégio. Morar num apartamento novo, com uma área privativa de 80 m² é um conforto e tanto!!!!!\r\n\r\nUm Bairro completo, com toda infraestrutura necessária para sua família viver bem. Em um endereço escolhido por ser um local calmo, o Edifício Vitale da as boas vindas à seus futuros moradores. Um privilégio para apenas seis famílias. Construído com materiais da melhor qualidade, e um projeto perfeito, com apartamentos totalmente ensolarados a partir do primeiro andar de apartamentos, ventilados, e todos com uma linda vista do Bairro.\r\n\r\nO Edifício Vitale tem dois apartamentos por andar, ambos com dois dormitórios , sendo uma confortável e espaçosa suíte com 15,38 m², o segundo dormitório com 10,65 m², cozinha americana, área de serviço com churrasqueira e ponto de gás para bifeira, banheiro social com ponto de ducha higiênica, amplo living para dois ambientes bem definidos, com sacada integrada ao living e espera para lareira, além da opção de duas vagas na garagem.\r\n\r\nAs esquadrias são de alumínio, amplas e que favorecem a claridade e a ventilação, esperas para ar condicionado tipo Split em todas as dependências, piso porcelanato em toda a área social, piso laminado de madeira na área íntima, tubulação para água quente, medidores individuais de luz, água e gás. Externamente revestido 100% com pastilhas de porcelana, dando mais qualidade e beleza ao visual. Custo condominial, baixo por não ter zeladoria e nem elevador. \r\n\r\nComemore está conquista. \r\n\r\nPreço promocional, referente ao apartamento 302, box 09 (para um automóvel).', '', 312000, 0, 0, 0, 1, 0, 1, 1, NULL, NULL, 1, '-29.1696152', '-51.511736499999984', NULL, '95700000', NULL, NULL, NULL, 0, NULL, '', '402880eb5ef3599a015ef35ac3d10002', '402880eb5f24e5d3015f24f516e0017e', '402880eb5f24e5d3015f24f516b4017d', '402880eb5f24e5d3015f24f4d1690066', '402880eb5f24e5d3015f24f2cf260001', '4028