('402880eb5f24e5d3015f24f5194d0189', 'Rua Goiânia', '561', NULL, NULL, 'Morar no Botafogo é um privilégio, bairro completo com toda infraestrutura necessária para sua família viver bem. \r\n\r\nApartamentos de dois dormitórios, sendo um suíte, cozinha, área de serviço, churrasqueira, banheiro social, amplo living para dois ambientes com sacada integrada, piso porcelanato nas áreas sociais e laminado nas áreas íntimas, massa corrida nas paredes, água quente, esquadrias externas em alumínio, porteiro eletrônico, espera para split e TV a cabo, opção para duas vagas na garagem (verificar preço).\r\n\r\nEdifício com localização privilegiada, apenas dois apartamentos por andar, elevador, revestimento externo em pastilhas e textura, gás central e medidores de água individuais. \r\n\r\nPrevisão de entrega para Dezembro de 2018.', '', 0, 0, 0, 98.61, 1, 0, 1, 1, NULL, NULL, 1, '-29.1696152', '-51.511736499999984', NULL, '957000-000', NULL, NULL, NULL, 488.39, NULL, '', '402880eb5ef3599a015ef35ac3d10002', '402880eb5f24e5d3015f24f5194c0188', '402880eb5f24e5d3015f24f519360187', '402880eb5f24e5d3015f24f4d1690066', '402880eb5f24e5d3015f24f2cf260001', '402880eb5f24e5d3015f24f2cecf0000', '402880eb5f24e5d3015f24f518f90185', '402880eb5f24e5d3015f24f5191a0186', NULL, NULL, '402880eb5ef3599a015ef35ac3b00000', '2017-10-16 09:32:43', '349', '2017-10-16 09:32:43', 0, 0, '  ', 74, NULL, 0, '402880eb5f24e5d3015f24f4c1f50032', NULL),
('402880eb5f24e5d3015f24f51aa00191', 'Av. presidente Kennedy', '1.657', NULL, NULL, 'InterCity Ribeirão Preto. Imagine-se dono de um quarto confortável, com amplo espaço, e todas as mordomias e serviços possíveis. \r\n\r\nSão os flats em unidades hoteleiras, com ganhos interessantes, superiores aos do mercado financeiro. Além disso o investimento em unidades hoteleiras preserva o patrimônio do investidor, por ter a posse de um bem concreto. Nesse sistema, chamado de Condo-hotel, nome dado ao conceito de empreendimento imobiliário com estrutura operacional hoteleira, todas as unidades são autônomas, com escrituras definitivas. Também no sistema de condo-hotel o desempenho mercadológico é melhor dos demais hotéis da região, entregando bons resultados financeiros à seus investidores. Mas uma das grandes vantagens em adquirir um flat hoteleiro em relação à um apartamento é que o flat já vem alugado. Nossa sugestão de investimento para este formato são os flats no HUB Ribeirão Preto, que será administrado pela Rede InterCity de Hotéis. O HUB é um empreendimento multiuso que reúne torre de hotel, longstay (apartamentos com serviços de hotel para longa estada), e mall (lojas de conveniência e serviços). Será construído estrategicamente junto aos principais acessos da cidade, a Avenida Maurílio Biagi e a Rodovia Castelo Branco, em terreno de 5.624 m². \r\nO hotel, que será administrado pela Rede Intercity Hotéis, formatado no padrão midscale, oferecerá serviço de  equipe de segurança, manobrista, wi-fi em todos os quartos e nas    áreas sociais, fitness, além do lobby com pé direito duplo, que integra as salas de conferência e treinamento ao restaurante do hotel. ', 'InÃ­cio das obras em Abril de 2015.', 289000, 0, 0, 0, 0, 0, 0, 0, NULL, NULL, 1, '-29.1696152', '-51.511736499999984', NULL, '14.096-340', NULL, NULL, NULL, 0, NULL, '', '402880eb5ef3599a015ef35ac3d10002', '402880eb5f24e5d3015f24f51a9f0190', '402880eb5f24e5d3015f24f51a63018f', '402880eb5f24e5d3015f24f51a1f018c