('402880eb5f24e5d3015f24f51c070197', '', '', NULL, NULL, 'Terreno plano, de esquina, medindo 10,00 x 22,00 em rua sem saída do Bairro Cidade Alta, e bem próximo à importante rua de acesso a todas as regiões da cidade, este terreno é um dos únicos à venda em bairros da cidade. \r\nOportunidade para construir sua casa em local muito calmo, e desfrutar de toda a tranquilidade com sua família.', 'Terreno cercado, com um poÃ§o de Ã¡gua no centro do terreno. Localizado atrÃ¡s do moinho Tondo, na Cidade Alta, em rua sem saÃ­da.', 235000, 0, 0, 0, 0, 0, 0, 0, NULL, NULL, 1, '-29.1696152', '-51.511736499999984', NULL, '', NULL, NULL, NULL, 0, NULL, '', '402880eb5ef3599a015ef35ac3d10002', '402880eb5f24e5d3015f24f51c060196', '402880eb5f24e5d3015f24f51be10195', '402880eb5f24e5d3015f24f51b500192', '402880eb5f24e5d3015f24f2cf260001', '402880eb5f24e5d3015f24f2cecf0000', '402880eb5f24e5d3015f24f51b7f0193', '402880eb5f24e5d3015f24f51ba20194', NULL, NULL, '402880eb5ef3599a015ef35ac3b00000', '2017-10-16 09:32:44', '351', '2017-10-16 09:32:44', 0, 0, '  ', 76, NULL, 0, '402880eb5f24e5d3015f24f4bb190019', NULL),
('402880eb5f24e5d3015f24f51d88019f', 'Rua Abdon Arroxelas, esquina com Noel Nutels', '', NULL, NULL, 'InterCity Premium Maceió. Invista aqui, e faça seu dinheiro trabalhar para você. \r\n\r\nMercado turístico já consolidado, e com tendência de crescimento, Maceió tem a orla mais bonita e charmosa do Brasil, e apresenta um crescimento anual médio do PIB superior a 13%. Maceió tem crescido à taxas muito superiores ao restante do País, e atraído turistas e investimentos. São novas indústrias, shoppings, empreendimentos imobiliários, redes de varejo de alimentos e material de construção que movimentam cada vez mais o setor de turismo e a economia. Este crescimento se reflete na movimentação do Aeroporto Internacional Zumbi dos Palmares, cujo número de passageiros praticamente dobrou de 2008 a 2012, e consolidou a capital alagoana como um dos mercados turísticos mais sólidos, com uma taxa de ocupação hoteleira acima de 70%, só comparada a grandes capitais como Rio de Janeiro e São Paulo. \r\n\r\nLocalizado a uma quadra da famosa Praia de Ponta Verde, o InterCity Premium Maceió é a síntese do que há de mais moderno em arquitetura hoteleira, onde tudo foi pensado para reduzir custos de operação e manutenção, com o objetivo de maximizar o lucro para os investidores. E a Rede InterCity, com 15 anos de experiência no ramo hoteleiro, e operações bem sucedidas de 22 hotéis em 14 cidades do Brasil é a garantia de que você investirá num empreendimento que nasce preparado para ser competitivo e rentável em todos os aspectos. \r\nPreço referente ao apartamento 713 mobiliado e decorado.', '', 266803.71, 0, 0, 0, 0, 0, 0, 0, NULL, NULL, 1, '-29.1696152', '-51.511736499999984', NULL, '', NULL, NULL, NULL, 0, NULL, '', '402880eb5ef3599a015ef35ac3d10002', '402880eb5f24e5d3015f24f51d88019e', '402880eb5f24e5d3015f24f51d4b019d', '402880eb5f24e5d3015f24f51cd0019a', '402880eb5f24e5d3015f24f51cac0199', '402880eb5f24e5d3015f24f51c820198', '402880eb5f24e5d3015f24f51cfc019b', '402880eb5f24e5d301