('402880eb5f24e5d3015f24f51f9c01a4', 'Rua Augusto Pasquali', '489', NULL, NULL, 'Residência de madeira na Rua Augusto Pasquali, no Bairro Botafogo, em terreno com área de 840,00m2, de 14,00 x 60,00 com pouca declividade. A casa pode ser desmanchada e o terreno é próprio para construção de edifício residencial, com vista do Bairro Santa Rita, e em endereço de grande valorização e crescimento comercial. Aceita 70% em permuta por apartamentos.', '', 930000, 0, 0, 0, 0, 0, 0, 3, NULL, NULL, 0, '-29.1696152', '-51.511736499999984', NULL, '95700-000', NULL, NULL, NULL, 0, NULL, '', '402880eb5ef3599a015ef35ac3d10002', '402880eb5f24e5d3015f24f51f9c01a3', '402880eb5f24e5d3015f24f51f4101a2', '402880eb5f24e5d3015f24f4d1690066', '402880eb5f24e5d3015f24f2cf260001', '402880eb5f24e5d3015f24f2cecf0000', '402880eb5f24e5d3015f24f51ee501a0', '402880eb5f24e5d3015f24f51f2c01a1', NULL, NULL, '402880eb5ef3599a015ef35ac3b00000', '2017-10-16 09:32:45', '353', '2017-10-16 09:32:45', 0, 0, '  ', 78, NULL, 0, '402880eb5f24e5d3015f24f4bb190019', NULL),
('402880eb5f24e5d3015f24f520e601ab', '', '', NULL, NULL, 'Seja dono do primeiro hotel da cidade de Guaíba. Localizada à menos de 30 Km de Porto Alegre, Guaíba tem acesso facilitado para a Capital, e vem ganhando destaque na indústria gaúcha, com investimentos em infraestrutura para receber empresas de grande porte. Uma cidade com um importante polo industrial e vivenciando um considerável crescimento, que demanda a visita de funcionários e executivos de outras regiões brasileiras, porém a cidade de Guaíba ainda não tem estrutura hoteleira, exigindo que os funcionários e executivos se hospedem em Porto Alegre, deslocando-se à Guaíba diariamente. A cidade ainda passa por uma grande transformação, recebendo o maior investimento privado da história do Estado, através da ampliação da empresa CMPC Celulose, com investimento estimado em mais de 5 bilhões de reais, gerando mais de 7 mil postos de trabalho diretos e 17 mil indiretos ainda em 2015. A cidade ainda conta com a construção da futura fábrica de caminhões chinesa Foton, com investimento de 250 milhões de reais, e geração de 350 empregos diretos. Outras importantes indústrias estão instaladas em Guaíba, como Thyssen Krupp Elevadores, e a Dell Computadores, na vizinha Eldorado do Sul. \r\n\r\nE é neste cenário, que a Rede Accor, líder mundial em operação hoteleira, e Íbis Hotéis, líder europeu e referência mundial em hotelaria, colocam mais uma bandeira Ibis. Com 4.200 m² de área construída, distribuídos em 80 apartamentos, dispostos em cinco pavimentos, com restaurante, e subsolo para 44 vagas de estacionamento, o Ibis Guaíba é uma oportunidade única de você ser dono do primeiro hotel da cidade. Com apartamentos mobiliados, com 19,09 m² de área privativa, internet e climatização. A localização é um dos pontos positivos do empreendimento, dentro de uma área nobre, com vista para o Guaíba, e futuro novo bairro planejado, com projeto de empreendimentos residenciais verticais, complexo comercial, e um condomínio residencial de terrenos. O hotel conta com o desenvolvimento, implantação, e gerenciamento da Atrio Hotéis, empresa que tem um modelo de negócios focado no retorno para investidor, conseguindo obter alta produtividade operacional, maximizando o retorno para seus investidores e satisfação dos hóspedes. Condições de pagamento facilitadas, com entrada e saldo parcelado até o final da obra ou com financiamento bancário após a entrega da obra.', '', 0, 0, 0, 0, 0, 0, 0, 0, NULL, NULL, 0, '-29.1696152', '-51.511736499999984', NULL, '', NULL, NULL, NULL, 417.22, NULL, '', '402880eb5ef3599a015ef35ac3d10002', '402880eb5f24e5d3015f24f520e601aa', '402880eb5f24e5d3015f24f520a701a9', '402880eb5f24e5d3015f24f5203201a6', '402880eb5f24e5d3015f24f5200901a5', '402880eb5f24e5d3015f24f2cecf0000', '402880eb5f24e5d3015f24f5205901a7', '402880eb5f24e5d3015f24f5207501a8', NULL, NULL, '402880eb5ef3599a015ef35ac3b00000', '2017-10-16 09:32:45', '354', '2017-10-16 09:32:45', 0, 0, '  ', 79, NULL, 0, '402880eb5f24e5d3015f24f4bb190019', NULL),
('402880eb5f24e5d3015f24f5221f01b2', 'Rua José Martelli', '349', NULL, NULL, 'Apartamentos em construção, com 72,80 m² de área privativa, dois dormitórios, living para dois ambientes com sacada integrada (21,12 m²), sacada aberta com churrasqueira (4,25 m²), cozinha (6,45 m²), lavanderia (2,93 m²), banheiro social e um box de garagem. Piso porcelanato nas áreas sociais e laminado nas áreas íntimas. Possui espera para lareira, água quente, medidores individuais, teto com acabamento em gesso e esquadrias em alumínio. Apartamentos ensolarados (leste/norte/oeste). \r\n\r\nEdifício com somente 16 unidades, sendo três apartamentos por andar, elevador, gás central e detalhes em pastilha cerâmica na fachada. Opção de mais um box de garagem.\r\n\r\nValor referente ao apartamento 203 com box de garagem 0205.\r\n', '', 0, 0, 0, 109.66, 1, 0, 0, 2, NULL, NULL, 0, '', '', NULL, '', NULL, NULL, NULL, 407, NULL, '', '402880eb5ef3599a015ef35ac3d10002', '402880eb5f24e5d3015f24f5221f01b1', '402880eb5f24e5d3015f24f521f101ae', '402880eb5f24e5d3015f24f4c88d004c', '402880eb5f24e5d3015f24f2cf260001', '402880eb5f24e5d3015f24f2cecf0000', '402880eb5f24e5d3015f24f5219e01ac', '402880eb5f24e5d3015f24f521cf01ad', NULL, NULL, '402880eb5ef3599a015ef35ac3b00000', '2017-10-16 09:32:45', '359', '2017-10-16 09:32:45', 0, 0, '  ', 80, NULL, 0, '402880eb5f24e5d3015f24f5221701b0', NULL),
('402880eb5f24e5d3015f24f5235701b7', 'Rua José Martelli', '349', NULL, NULL, 'Apartamentos em construção, com 42,56 m² de área privativa, um dormitório, living com sacada integrada (16,67 m²), cozinha (4,43 m²), área de serviço (1,24 m²), banheiro social e um box na garagem. Piso porcelanato nas áreas sociais e laminado na área íntima, espera para água quente, medidores individuais, teto com acabamento em gesso, esquadrias de alumínio. \r\n\r\nEdifício exclusivamente residencial, com somente 16 unidades, sendo três apartamentos por andar, elevador, gás central e detalhes em pastilha cerâmica na fachada, e opção de mais um box de garagem. Apartamentos totalmente ensolarados (oeste).\r\n\r\nValor referente ao apartamento 202 com box de garagem 0204.', '', 0, 0, 0, 64.38, 1, 0, 0, 1, NULL, NULL, 0, '', '', NULL, '', NULL, NULL, NULL, 257, NULL, '', '402880eb5ef3599a015ef35ac3d10002', '402880eb5f24e5d3015f24f5235701b6', '402880eb5f24e5d3015f24f5232f01b5', '402880eb5f24e5d3015f24f4c88d004c', '402880eb5f24e5d3015f24f2cf260001', '402880eb5f24e5d3015f24f2cecf0000', '402880eb5f24e5d3015f24f522ef01b3', '402880eb5f24e5d3015f24f5230601b4', NULL, NULL, '402880eb5ef3599a015ef35ac3b00000', '2017-10-16 09:32:46', '360', '2017-10-16 09:32:46', 0, 0, '  ', 81, NULL, 0, '402880eb5f24e5d3015f24f5221701b0', NULL),
('402880eb5f24e5d3015f24f524a101be', 'Rua Plácido de Castro', '1063', NULL, NULL, 'Sala comercial em construção no Bairro Exposição, em Caxias do Sul, no Edifício Vint Offices Exposição. Um empreendimento pensado para superar todas as expectativas, num dos melhores bairros da cidade, em região arborizada, com parques e praças, e uma completa rede de serviços, com bares, restaurantes, e pertinho do Centro. O Exposição é um Bairro onde muitos buscam estar, mas apenas alguns privilegiados conseguem. Pensado para os dias de hoje, o Vint é uma obra repleta de soluções inovadoras, com gerador de energia, reaproveitamento da água pluvial, completo sistema de segurança. Para instantes de relas, o Vint oferece no décimo terceiro andar a oportunidade de estar integrado ao verde e ao sol. Já no hall de entrada do Vint, os diferenciais são evidentes, com o acesso de visitantes controlado por catraias. Área comum com fitness equipado. O Vint conta ainda com duas salas de reuniões que podem ser integradas, formando uma Sala de Conferências com capacidade para setenta pessoas, equipadas com sistema de automação para áudio e vídeo, climatização e iluminação, além de contar com tela elétrica retrátil para projeções, projetor, persianas automatizadas, sistema de som multicanal, DVD/Blu-Ray, painel de mesa para videoconferências, e TV`s. O Vint está preparado para ser perfeito também depois do expediente. Um salão de festas equipado e mobiliado, e integrado com um louve externo, que por sua vez está integrado ao terraço verde. As salas estarão prontas para impressionar, com ar condicionado e calefação automatizados já instalados, piso porcelanato classe "A", vidros duplos para maior conforto térmico e acústico, laje nervurada sem vigas entre as salas. No térreo do Vint, acesso privativo para veículos, estacionamento rotativo, elevadores para as salas, elevador para o estacionamento rotativo. No décimo terceiro andar salas de conferências, salas de reuniões/videoconferências, academia,