('402880eb5f24e5d3015f24f531aa01f6', 'Rua Vitória', '135', NULL, NULL, 'Lançamento no Bairro Cidade Alta, o Edifício será edificado em uma das regiões mais nobres de Bento Gonçalves, com completa infraestrutura, próximo a supermercados, shopping, bancos, comércios diversos. \r\n\r\nOs apartamentos tem posição solar privilegiada, e seu projeto permite que os apartamentos tenham uma ótima iluminação e ventilação natural, proporcionando economia e bem estar aos seus moradores. Com amplos apartamentos de dois e três dormitórios, sendo que todos contarão com suíte, área de serviço com sacada, cozinha, área de serviço, banheiro social, e acabamentos de alto padrão de qualidade. No térreo cinco salas comerciais com pé direito duplo, e com vagas de estacionamento. Principais destaques do empreendimento, acabamento das paredes com massa corrida, tetos rebaixados em gesso em toda área interna do apartamento, esquadrias externas termo-acústicas em PVC, todos os ambientes com ventilação e insolação natural, garantindo qualidade de vida e economia de energia, espera para ar condicionado split na suíte e sala, churrasqueira, espera para lareira, suíte com sacada aberta, área de serviço independente e com sacada, área social ampla e com sacada fechada, piso laminado nos quartos e corredores íntimos, porcelanato/cerâmica na cozinha, área de serviço, banheiros e sacadas, opção de porcelanato ou laminado na área social, água quente / gás central, medidores de água, gás e luz individuais, dois elevadores, opção de até três vagas de garagem por apartamento, aproveitamento da água pluvial para jardins, calçadas e vasos sanitários, gerando economia e sustentabilidade, acabamentos (torneiras, revestimentos, louças...) de empresas com marcas reconhecidas e bem conceituadas no mercado, permite personalização dos apartamentos. \r\n\r\nO residencial ainda contará ainda com uma maravilhosa infraestrutura interna, composta de salão de festas, sala de jogos, brinquedoteca, playground, sala de gi