('402880eb5f24e5d3015f24f54c400260', 'Rua Antônio Ducatti', '', NULL, NULL, 'O bairro é soberano. A rua é sossegada, a vizinhança é top e você está cercado de facilidades. O bem-estar dentro e fora de casa, no clima, no charme do bairro, na conquista pelo seu merecido espaço. Este é o IMPERIUM RESIDENCE. Viver nele é estar a 200 metros do L''América Shopping, dos melhores cafés da cidade, do cinema, dos bancos 24 horas, das escolas e do bairro Planalto.\r\n\r\nApartamentos com 166 m² de área privativa e três opções de plantas.\r\n\r\n1° - Três dormitórios sendo um suíte.\r\n2° - Três suítes sendo duas americanas.\r\n3° - Três suítes.\r\n\r\nApartamentos com porcelanato nas áreas sociais e úmidas, laminado nas áreas íntimas, aplicação de manta antirruído nos pisos, paredes duplas entre as unidades, unidades com 100% de rebaixe de gesso, ampla área social com terraço integrado, cozinha americana, lavabo, churrasqueira com bifeira, dutos de espera para lareira de alto rendimento, esperas para instalação de ar condicionado tipo split nas áreas sociais e dormitórios, espera para calefação, opção de instalação de dutos de aquecimento dos ambientes, infraestrutura para automação dos apartamentos, medidores individuais de gás, água e energia, opção de dois ou três box de garagem.\r\n\r\nResidencial com dois apartamentos por andar, fachada inteiramente pastilhada, vidros refletivos com proteção solar, guarita com segurança, sistema de monitoramento por circuito interno de TV, hall social mobiliado e decorado, fitness center mobiliado e equipado, espaço gourmet mobiliado e equipado, espaço recanto e playground, brinquedoteca mobiliada e equipada, bicicletário.\r\n\r\nConta ainda com projeto luminotécnico e de eficiência energética, dispositivos economizadores e lâmpadas eficientes nas áreas comuns, elevador amplo de alta velocidade e econômico, sombreamento vegetal e uso de elementos paisagísticos para um melhor conforto térmico e visual, cobertura do prédio com preenchimento