('402880eb5f24e5d3015f24f555160286', 'Rua Da Margem ', '395', NULL, NULL, 'A cidade de Canela é conhecida por atrações turísticas como a Cascata do Caracol, o Parque da Ferradura, a Catedral de Pedra, entre outros inúmeros atrativos. Aqui você vai encontrar tranquilidade e muitas opções de lazer e descanso. Belos parques que usam como cenário as belezas naturais, matas nativas, ar puro, o cantar dos pássaros e belas estruturas construídas para o bem estar, proporcionando momentos de paz, diversão e lazer para as famílias. A riquíssima gastronomia de Canela contempla várias culturas. Eventos culturais para todas as idades, o ano todo. Comércios variados, artesanatos, couros e grifes. A possibilidade da neve no inverno é outro atrativo da região, onde a paisagem, já naturalmente bela, se transforma numa paisagem de cinema, emocionando turistas de todas as partes do Brasil e do mundo. Já no final de ano é o calor da época natalina que dá o show com espetáculos de som e luzes nos disputados Sonho de Natal de Canela, e no Natal Luz, na vizinha famosa, a encantadora cidade de Gramado. Assim é a Região das Hortênsias, com vários parques naturais como o Vale da Ferradura e Sequoias, além dos diversos parques como o Snow Land, Alpen Park, Mini Mundo, Museus e muito mais. \r\n\r\nE é neste cenário, em Canela, na badalada Serra Gaúcha, que estamos oferecendo este SONHO. \r\n\r\nUm imóvel feito especialmente para a família curtir a tranquilidade da região. Um Apartamento no Loteamento Parque Laje de Pedra, mobiliado, desocupado, com 78,80 m² de área privativa, distribuídos em dois dormitórios, sendo uma suíte (oeste), living para três ambientes (leste/sul) com lareira e churrasqueira, cozinha mobiliada, área de serviço, banheiro social, piso tabuão em todo apartamento, calefação em todas as dependências, esquadrias de madeira e garagem para um automóvel. \r\nEdifício com elevador, salão de festas e amplo jardim com quiosque. \r\nE o que dizer da localização? É atravessar a rua e estar junto a um grande lago, e uma imensa área verde, e junto às mais belas residências do Laje de Pedra, com guarita de segurança na entrada do Loteamento.', '', 600000, 0, 0, 90.41, 1, 0, 1, 1, NULL, NULL, 1, '', '', NULL, '', NULL, NULL, NULL, 0, NULL, '12419 / 12427', '402880eb5ef3599a015ef35ac3d10002', '402880eb5f24e5d3015f24f555150285', '402880eb5f24e5d3015f24f554e30284', '402880eb5f24e5d3015f24f554860281', '402880eb5f24e5d3015f24f5544b0280', '402880eb5f24e5d3015f24f2cecf0000', '402880eb5f24e5d3015f24f5549b0282', '402880eb5f24e5d3015f24f554b90283', NULL, NULL, '402880eb5ef3599a015ef35ac3b00000', '2017-10-16 09:32:58', '421', '2017-10-16 09:32:58', 0, 0, '  ', 121, NULL, 0, '402880eb5f24e5d3015f24f4bb190019', NULL),
('402880eb5f24e5d3015f24f55650028b', 'Rua Ângelo Salton com Ettore Giovani Perizzolo', '335', NULL, NULL, 'Residencial Madri - Encanta em cada detalhe. A localização valoriza o bem-estar, o projeto privilegia quem busca a beleza de viver.\r\n\r\nApartamentos em alto padrão com 109 m² de área privativa, ótima orientação solar, apenas dois apartamentos por andar, três dormitórios sendo um suíte.\r\n\r\nAlto padrão em acabamentos, porcelanato nas áreas sociais, piso laminado nos dormitórios, espera para lareira, churrasqueira e duas vagas de garagem com possibilidade de depósito. Conta ainda com sacada fechada, fachada com detalhes em pastilha, esquadrias em alumínio com possibilidade de vidro duplo, reaproveitamento da água da chuva para jardim, medição individual da água e gás e espera para split.\r\n\r\nAquecimento solar - Coletor solar / Tubo de vácuo, avançada tecnologia, mais rápido e eficiente. Resiste a temperaturas negativas.\r\n\r\nPrevisão de entrega estimada para Abril de 2017.\r\n\r\nNa compra de um apartamento você ganha uma viagem de sete dias com hospedagem paga para quatro pessoas - destino: Cancún (não inclui passagem e alimentação). É uma cidade que fica na costa do estado de Quintana Roo, no México, em uma península que se tornou um dos centros turísticos mais importantes do país, tendo conseguido preservar suas belezas naturais e sua cultura ancestral, representada principalmente em cidades maias, como Tulum, Uxmal ou Chichén Itzá, fundadas no período pré-colombiano. Em Cancún existem cerca de 22 quilômetros de praias de areia fina, divididos entre a lagoa e o mar. As ruínas, as praias, a vegetação, os parques cheios de espetáculos de entretenimento, o clima, a fauna marinha e a estrutura hoteleira fazem de Cancún um dos destinos turísticos mais visitados do México.\r\n\r\nValor referente ao apartamento 201 com duas vagas individuais na garagem (01 e 02).', 'Corretor que mais vender apartamentos ganha uma viagem para CancÃºn no MÃ©xico.', 0, 0, 0, 