('402880eb5f24e5d3015f24f5589b0295', 'Rua General Goes Monteiro', '', NULL, NULL, 'Contemple a vista do entardecer.\r\nSinta - Tudo a 10 minutos a pé: Praça São Bento, ciclovia, academia, centro da cidade, corredor gastronômico, casa das artes, casas noturnas, supermercado, posto de abastecimento/conveniência. \r\nViva - A 20 minutos: Parque da Fundaparque (Fenavinho), shows / feiras e eventos, ciclovia, saída sudeste da cidade.\r\nAqui você terá ainda mais motivos para viver a vida.\r\n\r\nCaracterísticas dos apartamentos: Espaços amplos e bem planejados, cozinha estilo americana com churrasqueira, suíte com closet, living com sala de jantar e espera para lareira, área de serviço fechada, esperas para split nos dormitórios e living, pisos internos em porcelanato e laminado alto padrão, personalização de acabamentos internos, esquadrias PVC/Alumínio com opção de vidros termoacústicos.\r\n\r\nCaracterísticas do condomínio: Salão de festas, elevador, playground para recreação infantil, área de lazer com piscina, ajardinamento, reaproveitamento de águas pluviais, magnífica vista da cidade e orientação solar privilegiada. Apenas três apartamentos por andar.\r\n\r\nPrevisão de entrega para 2020.\r\n\r\nValor referente ao apartamento 201 de dois dormitórios sendo um suíte com 108,51 m² de área privativa + box duplo de garagem.', 'Parceria Kiko ImÃ³veis. Planta dos Box com a construtora.', 0, 0, 0, 200.27, 2, 0, 1, 1, NULL, NULL, 1, '', '', NULL, '', NULL, NULL, NULL, 665, NULL, '', '402880eb5ef3599a015ef35ac3d10002', '402880eb5f24e5d3015f24f5589b0294', '402880eb5f24e5d3015f24f558740293', '402880eb5f24e5d3015f24f4c72e0046', '402880eb5f24e5d3015f24f2cf260001', '402880eb5f24e5d3015f24f2cecf0000', '402880eb5f24e5d3015f24f558330291', '402880eb5f24e5d3015f24f558470292', NULL, NULL, '402880eb5ef3599a015ef35ac3b00000', '2017-10-16 09:32:59', '424', '2017-10-16 09:32:59', 0, 0, '  ', 124, NULL, 0, '402880eb5f24e5d3015f24f4c1f50032', NULL),
