('402880eb5f24e5d3015f24f55d6802a9', 'Rua 3 de Outubro ', 'nº 125', NULL, NULL, 'Inteligente é Você Pensar no Futuro. \r\n\r\nApartamento de andar inteiro, com 195 m² de área privativa, construção de alto padrão e acabamento, desocupado, ensolarado, com três dormitórios, sendo uma suíte ampla com closet e banheiro com hidromassagem, lavabo, living para três ambientes com sacada (oeste), lareira com revestimento em mármore travertino, sacada integrada (norte) com churrasqueira e pia, banheiro social, ampla cozinha, área de serviço, espaço web, dependência de empregada ou gabinete, calefação em todas as dependências, acabamentos em gesso, iluminação embutida, piso tabuão nos dormitórios, living e circulação, esquadrias de madeira, e garagem para dois automóveis.\r\n\r\nEdifício exclusivamente residencial, com elevador codificado, salão de festas com sacada, equipado e mobiliado, fachada totalmente revestida com pastilhas cerâmicas, localizado próximo a todos os recursos do Bairro Cidade Alta, e de fácil acesso a todas as regiões da cidade.', '', 850000, 0, 0, 255, 2, 0, 1, 2, NULL, NULL, 1, '', '', NULL, '957000-000', NULL, NULL, NULL, 0, NULL, '', '402880eb5ef3599a015ef35ac3d10002', '402880eb5f24e5d3015f24f55d6802a8', '402880eb5f24e5d3015f24f55d4f02a7', '402880eb5f24e5d3015f24f51b500192', '402880eb5f24e5d3015f24f2cf260001', '402880eb5f24e5d3015f24f2cecf0000', '402880eb5f24e5d3015f24f55ce702a5', '402880eb5f24e5d3015f24f55d1102a6', NULL, NULL, '402880eb5ef3599a015ef35ac3b00000', '2017-10-16 09:33:00', '433', '2017-10-16 09:33:00', 0, 0, '  ', 128, NULL, 0, '402880eb5f24e5d3015f24f4bb190019', NULL),
('402880eb5f24e5d3015f24f55e8102ae', 'Travessa Niterói', '94', NULL, NULL, 'Bem-vindo!!!\r\nLocalizado em um dos pontos mais altos e nobres de Bento Gonçalves, será construído em um bairro tranquilo, com infraestrutura completa, fácil acesso e locomoção.\r\n\r\nAmbientes integrados, somados a sacada fechada, conferem alta luminosidade e vista privilegiada em todos os apartamentos.\r\n\r\nSerá exclusivamente residencial e composto por apartamentos de dois dormitórios. Seus quatro apartamentos por andar contarão com amplas áreas sociais, criadas a partir de ambientes integrados e bem iluminados.\r\nTodos os apartamentos serão equipados com churrasqueira, esquadrias de alumínio com vidro termo acústicos nos dormitórios e espera para splits nos quartos e salas.\r\nAs unidades contarão com forro de gesso, acabamento das paredes em massa corrida, piso porcelanato nas áreas sociais e laminado nas áreas íntimas, medições individuais de água e gás.\r\n\r\nO Alta Cittá será totalmente pastilhado e equipado com esquadrias de alumínio. O prédio contará com dois elevadores de alta velocidade e gerador de energia que atenderá elevadores, garagens e áreas de uso comum. Contará ainda com guarita, salão de festas e hall de entrada que serão entregues equipados e mobiliados.\r\n\r\nValor referente ao apartamento 201 (86,62 m² de área privativa) com box simples de garagem 105.', '', 0, 0, 0, 116.16, 1, 0, 0, 2, NULL, NULL, 1, '', '', NULL, '', NULL, NULL, NULL, 532.1, NULL, '', '402880eb5ef3599a015ef35ac3d10002', '402880eb5f24e5d3015f24f55e8102ad', '402880eb5f24e5d3015f24f55e6d02ac', '402880eb5f24e5d3015f24f51b500192', '402880eb5f24e5d3015f24f2cf260001', '402880eb5f24e5d3015f24f2cecf0000', '402880eb5f24e5d3015f24f55e2302aa', '402880eb5f24e5d3015f24f55e4e02ab', NULL, NULL, '402880eb5ef3599a015ef35ac3b00000', '2017-10-16 09:33:01', '436', '2017-10-16 09:33:01', 0, 0, '  ', 129, NULL, 0, '402880eb5f24e5d3015f24f4c1f50032', NULL),
