('402880eb5f24e5d3015f24f5659702cc', 'Linha Palmeiro', '', NULL, NULL, 'Vendo este Sonho!\r\nUm lindo e abençoado recanto, a 10 Km do Centro de Bento Gonçalves, e a 2 Km dos Caminhos de Pedra, com uma área total de 9.863 m². Um exuberante cenário de paz, onde a natureza, numa perfeita harmonia de cores e formas, proporciona conforto permanente aos olhos de quem busca encontrar serenidade.\r\nJá na chegada, uma alameda com palmeiras dá as boas vindas.Tudo que encontramos neste lugar é um convite para desacelerar nossa mente, desde o sol nascente, as plantas ornamentais, árvores que servem de repouso aos pássaros mais diversos que ali repousam, e o vento fazendo as folhas e os galhos cantarem. \r\nA noite o silêncio só é quebrado pelos hinos das cigarras, dos grilos, e das corujas. Este é um recanto de paz, onde a vida flui harmoniosa e gentilmente. Um recanto de paz, cheio de flores, cheio de cores, e de perfumes diversos. Este é um recanto prazeroso, agradável, e belo de se ver. É um SONHO. Um sonho para quem deseja desfrutar de um lugar abençoado. \r\nAs duas edificações, uma já foi pousada, com dois pavimentos, e com seus dormitórios, todos com banheiros, e com 257,50 m² de área construída. A outra, com três pavimentos, em estilo colonial, também já foi pousada, e atualmente é uma residência confortável, para desfrute de seus proprietários e convidados aos finais de semana, com 385 m² de área construída. E mais um galpão, com 96,00 m² de área construída.\r\nA área externa valoriza a natureza, a fauna e a flora, com vegetação abundante, e inúmeros animais que adotaram o local como morada, ou simplesmente por um espaço de tempo junto com outros, estes sim, moradores permanentes, como os patos, com seu espaço próprio cercado, e com toda a comodidade que necessitam.\r\nOs lagos e o riacho de águas cristalinas que cortam a propriedade também fazem parte deste cenário paradisíaco, junto da piscina, caprichosamente instalada para atender amigos e familiares, um atrativo e um convite ao relax.\r\nAinda fazem parte deste cenário, uma área gramada para futebol e pergolados.\r\nA segurança conta com portão eletrônico na entrada, câmeras de segurança com visualização por celular, e alarme monitorado.\r\nQue aquele que se tornar o proprietário deste sonho possa ter sua sensibilidade estimulada, e sua paz de espírito acalentada neste recanto de tanta luz, harmonia, e serenidade. Este é o recanto de delícia e de paz, onde as flores exalam poder, e em consequência deste intenso contato com a natureza nos tornamos cada vez mais felizes e gratos por viver.', '', 1850000, 0, 0, 0, 0, 0, 0, 0, NULL, NULL, 1, '', '', NULL, '', NULL, NULL, NULL, 0, NULL, '', '402880eb5ef3599a015ef35ac3d10002', '402880eb5f24e5d3015f24f5659702cb', '402880eb5f24e5d3015f24f5658102ca', '402880eb5f24e5d3015f24f4bdc20021', '402880eb5f24e5d3015f24f2cf260001', '402880eb5f24e5d3015f24f2cecf0000', '402880eb5f24e5d3015f24f5653f02c8', '402880eb5f24e5d3015f24f5656502c9', NULL, NULL, '402880eb5ef3599a015ef35ac3b00000', '2017-10-16 09:33:02', '444', '2017-10-16 09:33:02', 0, 0, '  ', 135, NULL, 0, '402880eb5f24e5d3015f24f4bb190019', NULL),
