('402880eb5f24e5d3015f24f58f120375', 'Parte do Lote Rural n° 73, da Linha Palmeiro', '73', NULL, NULL, 'Sítio de extrema beleza natural, construído especialmente para o lazer e bem estar da família, à 12 Km do Centro de Bento Gonçalves por estrada asfaltada, e 1.300ms de boa estrada não pavimentada. Neste sítio de dois hectares encontra-se estampado todo cuidado em cada detalhe da construção. Com água abundante de poço artesiano, e um pomar diversificado (uva, kiwi, laranja), um forno de pedra decorando a paisagem, junto ao arvoredo e o gramado verde.  Nos fundos, uma área com mata, e uma grande área preparada para cultivo. A casa é uma moradia encantada, com 260m2 distribuídos em quatro dormitórios, quatro banheiros, ampla despensa, lavanderia, cozinha americana mobiliada (Cenci), churrasqueira com bifeira, sala de estar, e uma grande sala de jantar para acomodar trinta pessoas sentadas nas duas mesas. Na área externa, junto à piscina aquecida, um quiosque fechado em vidro, mobiliado, com cozinha e churrasqueira e bifeira, especialmente para receber amigos e familiares. Do mirante construído em madeira, avista-se o lago artificial, e mais ao longe, as áreas vizinhas, com açudes que embelezam ainda mais este paraíso.  Área totalmente cercada e murada, à 2 Km de todos os pontos turísticos da região dos Caminhos de Pedra. Aqui sua família será feliz.', 'Terreno cercado por muros e cercas; 4 DormitÃ³rios com diversas camas e beliches; 4 banheiros, Ã?rea de serviÃ§os; Sala e cozinha integradas; 1 compartimento interno para depÃ³sito; Quiosque; Piscina aquecida; Forno de pedras; PoÃ§o artesiano; AÃ§ude (em construÃ§Ã£o).. \r\nA 2km da Casa da Ovelha, prÃ³ximo a Cantina Strapazzon, Casa Vanni, Casa Fracalossi..\r\nMilharal, Batata doce, Cebolinhas, Laranjeiras, Bergamota, Arroz, Uva, Repolho Roxo.. ', 1500000, 0, 0, 0, 0, 0, 0, 0, NULL, NULL, 0, '', '', NULL, '95700-000', NULL, NULL, NULL, 0, NULL, '43.238', '402880eb5ef3599a015ef35ac3d10002', '402880eb5f24e5d3015f24f58f1