('402880eb5f24e5d3015f24f5b7ec0418', 'Rua Ivone Tereza Michelon', '320', NULL, NULL, 'Apartamento de um dormitório ensolarado Norte com 42,87 m² de área privativa, living estar / jantar com sacada integrada, cozinha, área de serviço com churrasqueira, circulação e banheiro social. Esquadrias em alumínio, espera para split e internet, porcelanato na área social e laminado na área íntima, medidores de água e gás individuais, acabamento em massa corrida e gesso em todo o apartamento.\r\n\r\nImóvel semi mobiliado e próximo ao Centro da cidade, garantindo melhor comodidade e praticidade. O empreendimento conta com salão de festas, espaço gourmet, fitness e brinquedoteca.\r\n', 'O Apartamento estÃ¡ semi mobiliado. Foi comprado por investimento e estÃ¡ sendo alugado por temporada. \r\nCadastro atualizado em 05 de Outubro de 2017;', 212000, 6, 0, 59.99, 1, 0, 0, 1, NULL, NULL, 1, '', '', NULL, '', NULL, NULL, NULL, 0, NULL, '', '402880eb5ef3599a015ef35ac3d10002', '402880eb5f24e5d3015f24f5b7ec0417', '402880eb5f24e5d3015f24f5b7c80416', '402880eb5f24e5d3015f24f4d2b7006c', '402880eb5f24e5d3015f24f2cf260001', '402880eb5f24e5d3015f24f2cecf0000', '402880eb5f24e5d3015f24f5b7600414', '402880eb5f24e5d3015f24f5b78f0415', NULL, NULL, '402880eb5ef3599a015ef35ac3b00000', '2017-10-16 09:33:24', '567', '2017-10-16 09:33:24', 0, 0, '  ', 199, NULL, 0, '402880eb5f24e5d3015f24f56cf802ed', NULL),
