('402880eb5f24e5d3015f24f5ba630422', 'Rua Severo Giacomello', '862', NULL, NULL, 'Fina residência mobiliada e decorada, com 290 m² de área construída, em terreno de 13,80 por 42,00m (579,60 m²) distribuídos em dois pavimentos, tendo na parte inferior uma cozinha, living de dois ambientes mobiliado com móveis Idéias & Conceitos, lareira, banheiro social, ampla garagem de 6,00 x 6,50 com fogão à lenha, churrasqueira com bifeira, banheiro auxiliar, dependência de empregada, e escada em granito, de acesso ao pavimento superior, com área de circulação, quatro dormitórios (três dormitórios com sacada), sendo uma ampla suíte do casal com closet (5,40 x 4,40), banheira de hidromassagem, e sacada (leste), banheiro social, estruturada por colunas.\r\n\r\nConstruída com materiais de qualidade comprovada, a casa conta com aquecimento solar, tetos rebaixados em gesso, portas de correr em compensado naval e massa corrida.\r\n\r\nA segurança da família também foi pensada, com cerca e muros com colunas de concreto cerca elétrica, alarme, câmeras de segurança, vidros duplos e laminados.\r\n \r\nNa parte externa uma grande área nos fundos, para o lazer, com iluminação e refletores, e na parte frontal um jardim dá as boas vidas à nova família.\r\n    \r\nLocalizada numa das regiões mais valorizadas de Bento Gonçalves, no Santo Antão, junto a belas casas, com uma vista panorâmica de tirar o fôlego, este endereço tranquilo que é um convite à uma caminhada diária pela região.\r\n', 'Ficam mÃ³veis fixos .', 1590000, 0, 0, 0, 2, 0, 1, 3, NULL, NULL, 1, '', '', NULL, '95700-000', NULL, NULL, NULL, 0, NULL, '', '402880eb5ef3599a015ef35ac3d10002', '402880eb5f24e5d3015f24f5ba630421', '402880eb5f24e5d3015f24f5ba360420', '402880eb5f24e5d3015f24f4e4e100b1', '402880eb5f24e5d3015f24f2cf260001', '402880eb5f24e5d3015f24f2cecf0000', '402880eb5f24e5d3015f24f5b9f5041e', '402880eb5f24e5d3015f24f5ba0b041f', NULL, NULL, '402880eb5ef3599a015ef35ac3b00000', '2017-10-16 09:33:24', '576', '2017-10-16 09:33:24'