('402880eb5f24e5d3015f24f5bba40427', '', '', NULL, NULL, 'Casa de alvenaria com aproximadamente 320 m² de área construída, junto à belas residências em lugar tranquilo e loteamento de alto padrão, em terreno de 17 x 30 = 510 m². Situado no Loteamento Bertuol.\r\n\r\nCom três dormitórios (primeiro dormitório com posição solar leste; segundo dormitório oeste) sendo uma suíte (oeste), living para dois ambientes (estar/jantar),cozinha com área de serviço separada, banheiro social, churrasqueira e duas vagas na garagem. Piso porcelanato e laminado, rebaixe de gesso em todos os ambientes, lareira e split em todos os cômodos, água quente, portão eletrônico garagem e massa corrida em todas as paredes internas.\r\n\r\nAquecimento solar, aquecedor de água, entradas para internet - tv à cabo - telefone,  telhas de concreto planas, esquadrias em madeira de alta qualidade com vedação. Sistema de alarme e câmeras. \r\n\r\nCasa com ambientes amplos e bem distribuídos. Frente norte (ótima posição solar).\r\n', 'Aceita apto como forma de pagamento.', 1270000, 0, 0, 0, 2, 0, 1, 2, NULL, NULL, 1, '', '', NULL, '', NULL, NULL, NULL, 0, NULL, '', '402880eb5ef3599a015ef35ac3d10002', '402880eb5f24e5d3015f24f5bba40426', '402880eb5f24e5d3015f24f5bb780425', '402880eb5f24e5d3015f24f2cf4f0002', '402880eb5f24e5d3015f24f2cf260001', '402880eb5f24e5d3015f24f2cecf0000', '402880eb5f24e5d3015f24f5bb300423', '402880eb5f24e5d3015f24f5bb550424', NULL, NULL, '402880eb5ef3599a015ef35ac3b00000', '2017-10-16 09:33:25', '577', '2017-10-16 09:33:25', 0, 0, '  ', 202, NULL, 0, '402880eb5f24e5d3015f24f4b9550011', NULL),
('402880eb5f24e5d3015f24f5bce1042c', 'Rua Fioravante Pozza', '620', NULL, NULL, 'Apartamento de dois dormitórios com 49,86 m² de área privativa, situado em andar alto, sendo o dormitório de casal (norte), e dormitório de solteiro (oeste), living para dois ambientes, cozinha, área de serviço, banheiro social e uma vaga dupla de garagem. \r\n\r\nApartamento com todos móveis, decoração e eletros (exceto máquina de lava/seca, refrigerador e o televidor da sala).', 'Proprietario bem flexivel na negociaÃ§Ã£o, aceita carro como forma de pagamento.\r\nA um saldo a ser pago de R$ 37mil junto a Caixa Federal.', 178000, 6, 0, 60.99, 2, 0, 0, 2, NULL, NULL, 1, '', '', NULL, '95700-000', NULL, NULL, NULL, 0, NULL, '', '402880eb5ef3599a015ef35ac3d10002', '402880eb5f24e5d3015f24f5bce1042b', '402880eb5f24e5d3015f24f5bca7042a', '402880eb5f24e5d3015f24f4c88d004c', '402880eb5f24e5d3015f24f2cf260001', '402880eb5f24e5d3015f24f2cecf0000', '402880eb5f24e5d3015f24f5bc780428', '402880eb5f24e5d3015f24f5bc920429', NULL, NULL, '402880eb5ef3599a015ef35ac3b00000', '2017-10-16 09:33:25', '579', '2017-10-16 09:33:25', 0, 0, '  ', 203, NULL, 0, '402880eb5f24e5d3015f24f4b9550011', NULL),
