('402880eb5f24e5d3015f24f5c6b10454', 'Garibaldina', '', NULL, NULL, 'Sítio de extrema beleza, à 5 Km de Bento Gonçalves. Aqui a natureza é tão perfeita que não precisa de photoshop. A vida corrida da cidade nos remete fazer o caminho contrário que fizeram nossos avós, ou bisavós. Se eles vieram do sitio para a cidade, agora nós estamos voltando para o mato para reencontrar a tranquilidade perdida. Este sítio de 36.500 m², na Garibaldina, totalmente cercado, com portão eletrônico, casa para caseiro, gramado para futebol, quiosque mobiliado para festas, com churrasqueira, cozinha, forno para pizza, lareira, banheiro, e acesso à piscina aquecida, com vestiários feminino e masculino. Desde a entrada o perfume das flores, e o cheiro do verde da mata nos acompanham em estrada pavimentada por toda a extensão. Uma verdadeira obra de arte da natureza. ', '', 3800000, 0, 0, 0, 0, 0, 0, 0, NULL, NULL, 1, '', '', NULL, '', NULL, NULL, NULL, 0, NULL, '', '402880eb5ef3599a015ef35ac3d10002', '402880eb5f24e5d3015f24f5c6b10453', '402880eb5f24e5d3015f24f5c69c0452', '402880eb5f24e5d3015f24f575ed0310', '402880eb5f24e5d3015f24f572920304', '402880eb5f24e5d3015f24f2cecf0000', '402880eb5f24e5d3015f24f5c65f0450', '402880eb5f24e5d3015f24f5c6800451', NULL, NULL, '402880eb5ef3599a015ef35ac3b00000', '2017-10-16 09:33:27', '593', '2017-10-16 09:33:27', 0, 0, '  ', 211, NULL, 0, '402880eb5f24e5d3015f24f4bb190019', NULL),
