('402880eb5f24e5d3015f24f5d7070490', 'Loteamento Mirante do Vale', '', NULL, NULL, '- Casa de 782,00 m², dividida em 2 pavimentos, 3 suítes sendo 1 suíte máster com aproximadamente 85m² e banheiro duplo, quarto de hospedes, brinquedoteca, salão de festas, cozinha, lavanderia, dispensa, banho de empregados, lavabo, edificada sobre um terreno de 1.380,00 m²e mais 450m² (faixa de 10m x 45m) nos fundos, que foi incorporado pelos proprietários dos lotes que fazem fundo com a área verde do condomínio.\r\n- Esquadrias de PVC Kommerling (alemã) com vidros duplos e laminados; na sala e no sala de festas são esquadrias elevadoras de aproximadamente 4m de altura com vidros de 20mm.\r\n- Persianas dos quartos com acionamento elétrico.\r\n- Portas internas em alumínio e vidro branco acidato Cinex.\r\n- Todas portas de armários e closets também em vidro Cinex.\r\n- Móveis Dellanno.\r\n- Piso da sala em porcelanato italiano, pedras de 1,20 x 1,20, com aquecimento.\r\n- Calefação e splits em todas peças da casa.\r\n- Banheiros da parte intima também com piso aquecido.\r\n- Sala com pé direito de 4,5m.\r\n- Salão de festas com piso de madeira de demolição e bar e lareira em silestone.\r\n- Escadas e revestimento da caixa do elevador em travertino romano bruto.\r\n- Toda automatizada; comanda splits, tvs, persianas e cortinas tudo pelo iphone.\r\n- Circuito interno e externo de câmeras de vigilância.\r\n- Garagem para 8 carros.\r\n- Espera para elevador.\r\n- Adega climatizada com capacidade aproximada de 1000 garrafas.\r\n- Sistema de geração de energia solar.\r\n- Aquecimento por caldeira a diesel e por placas solares.\r\n- Espera para gerador.\r\n', '', 7500000, 0, 0, 0, 8, 0, 3, 0, NULL, NULL, 0, '', '', NULL, '', NULL, NULL, NULL, 0, NULL, '', '402880eb5ef3599a015ef35ac3d10002', '402880eb5f24e5d3015f24f5d707048f', '402880eb5f24e5d3015f24f5d6c2048e', '402880eb5f24e5d3015f24f5150b0175', '402880eb5f24e5d3015f24f2cf260001', '402880eb5f24e5d3015f24f2cecf0000', '402880eb5f24e5d3015f24