('402880eb5f24e5d3015f24f5d8a80495', 'Rua Candelária', '269', NULL, NULL, 'Apartamento ensolarado com dois dormitórios, banheiro social, sala e cozinha integradas, lavanderia, com piso cerâmico em todos os cômodos e com garagem.\r\n\r\nEdifício com garagens totalmente fechadas com portões individuais por pavimento, estrutura de concreto até o nível térreo, estrutura em alvenaria estrutural de blocos de concreto do térreo ao sexto pavimento, esquadrias externas em alumínio com persianas nos dormitórios, pisos cerâmicos em todas as dependências dos apartamentos e circulações, dois elevadores, sendo um por bloco, atendendo os três subsolos e os demais pisos, escada protegida contra incêndio, medidores individuais de água e gás, porteiro eletrônico. \r\n', '', 0, 0, 0, 61.03, 1, 0, 0, 2, NULL, NULL, 0, '', '', NULL, '95700-000', NULL, NULL, NULL, 243.09, NULL, '', '402880eb5ef3599a015ef35ac3d10002', '402880eb5f24e5d3015f24f5d8a80494', '402880eb5f24e5d3015f24f5d8600493', '402880eb5f24e5d3015f24f51b500192', '402880eb5f24e5d3015f24f2cf260001', '402880eb5f24e5d3015f24f2cecf0000', '402880eb5f24e5d3015f24f5d7e70491', '402880eb5f24e5d3015f24f5d8330492', NULL, NULL, '402880eb5ef3599a015ef35ac3b00000', '2017-10-16 09:33:32', '622', '2017-10-16 09:33:32', 0, 0, '  ', 224, NULL, 0, '402880eb5f24e5d3015f24f56cf802ed', NULL),
('402880eb5f24e5d3015f24f5da46049a', 'Rua Candelária', '269', NULL, NULL, 'Apartamento ensolarado com dois dormitórios, banheiro social, sala e cozinha integradas, lavanderia. Piso cerâmico em todos os cômodos e uma vaga de garagem.\r\n \r\nEdifício com garagens totalmente fechadas com portões individuais por pavimento, estrutura de concreto até o nível térreo, estrutura em alvenaria estrutural de blocos de concreto do térreo ao sexto pavimento, esquadrias externas em alumínio com persianas nos dormitórios, pisos cerâmicos em todas as dependências dos apartamentos e circulações, dois elevadores, sendo um por bloco, atendendo os três subsolos e os demais pisos, escada protegida contra incêndio, medidores individuais de água e gás, porteiro eletrônico. \r\n\r\n', 'Existe possibilidade de compra de depÃ³sito. ', 0, 0, 0, 57.02, 1, 0, 0, 2, NULL, NULL, 0, '', '', NULL, '95700-000', NULL, NULL, NULL, 227.46, NULL, '', '402880eb5ef3599a015ef35ac3d10002', '402880eb5f24e5d3015f24f5da460499', '402880eb5f24e5d3015f24f5da0e0498', '402880eb5f24e5d3015f24f51b500192', '402880eb5f24e5d3015f24f2cf260001', '402880eb5f24e5d3015f24f2cecf0000', '402880eb5f24e5d3015f24f5d9b10496', '402880eb5f24e5d3015f24f5d9db0497', NULL, NULL, '402880eb5ef3599a015ef35ac3b00000', '2017-10-16 09:33:32', '623', '2017-10-16 09:33:32', 0, 0, '  ', 225, NULL, 0, '402880eb5f24e5d3015f24f56cf802ed', NULL),
('402880eb5f24e5d3015f24f5db9c049f', 'Rua Cesarino Carlo Romagna', '78', NULL, NULL, 'Apartamento mobiliado com 69,00 m² privativos, dois dormitórios com sacada aberta no principal, sala de estar com sacada aberta, cozinha, área de serviço e banheiro social. Na cozinha móveis planejados Manfroi, fogão cooktop em inox marca Fischer, forno elétrico e depurador marca Fischer, na área de serviço móveis sob medida ( Loja SCA ), pia em granito garantindo maior durabilidade, piso cerâmico e laminado nas áreas intimas. Apartamento ensolarado Leste/Norte. Duas vagas de garagem cobertas. \r\nCondomínio Residencial Vista Alegre, oferecendo toda a segurança para você e sua família. Possui área de lazer infantil, vigia noturno, quadra de futebol, salão de festas e ainda belos quiosques externos com churrasqueira. ', 'Apartamento mobiliado, sÃ³ saem: SofÃ¡ da sala, geladeira, fogÃ£o e mesa. O resto fica tudo .Ã?rea de serviÃ§o mÃ³veis SCA; OpÃ§Ã£o para ficar com uma vaga de garagem, valor final R$ 233.200,00 .\r\nATUALIZAÃ?Ã?O DE DADOS EM 12 de Setembro de 2017;', 249100, 6, 0, 0, 2, 0, 0, 2, NULL, NULL, 1, '', '', NULL, '95700-000', NULL, NULL, NULL, 0, NULL, '', '402880eb5ef3599a015ef35ac3d10002', '402880eb5f24e5d3015f24f5db9c049e', '402880eb5f24e5d3015f24f5db69049d', '402880eb5f24e5d3015f24f59125037b', '402880eb5f24e5d3015f24f2cf260001', '402880eb5f24e5d3015f24f2cecf0000', '402880eb5f24e5d3015f24f5db24049b', '402880eb5f24e5d3015f24f5db52049c', NULL, NULL, '402880eb5ef3599a015ef35ac3b00000', '2017-10-16 09:33:33', '624', '2017-10-16 09:33:33', 0, 0, '  ', 226, NULL, 0, '402880eb5f24e5d3015f24f56cf802ed', NULL),
('402880eb5f24e5d3015f24f5dd1c04a4', 'Rua Gasper Cainelli', '', NULL, NULL, 'Residência de alvenaria com 350 m² de área construída em terreno de 15,00m x 33,00 m.\r\n\r\nPrimeiro pavimento é dividido em sala de estar com lareira, ampla sala de jantar, cozinha, área de serviço, banheiro social, lavabo e um quarto para hóspedes. O ambiente conta com cores claras tanto no piso em porcelanato quanto nas paredes. Garagem para dois veículos.\r\n\r\nEscada em mármore da acesso ao segundo pavimento, que é distribuído por área de circulação, três dormitórios com suíte e closet embutido, sendo dois com sacada aberta. Escritório e depósito.\r\n\r\nChegando ao lado posterior da casa, notamos a beleza de suas linhas amplas que formam uma estrutura com piso superior. E para aproveitar melhor os dias de sol junto a família, uma bela piscina aquecida com piso cerâmico anti derrapante. O cenário natural é acolhedor, e assim como os espaços internos, é perfeito para relaxar.\r\n\r\nPossui ainda salão de festas fechado com vidros duplos e na parte interna, paredes em pedras contribuem para o charme do ambiente. Conta também com churrasqueira rotativa e bifeira. Banheiro social.\r\n\r\nA casa possui detalhes em vidros, espera para gás central e espera para split. Piso porcelanato, escada revestida em mármore, teto rebaixado com gesso e iluminação. Aquecimento de água solar, com boiler na casa toda e aquecimento complementar a gás. Lareira canadense com dutos para aquecer dois ambientes adicionais.\r\n\r\nE para sua segurança, muros em pedra com cerca elétrica, alarme central, sistema de segurança  com oito câmeras internas e externas coloridas e com visão noturna com monitoramento via celular.  ', '', 1600000, 0, 0, 0, 2, 0, 3, 1, NULL, NULL, 1, '', '', NULL, '95700-000', NULL, NULL, NULL, 0, NULL, '', '402880eb5ef3599a015ef35ac3d10002', '402880eb5f24e5d3015f24f5dd1c04a3', '402880eb5f24e5d3015f24f5dcdb04a2', '402880eb5f24e5d3015f24f4e4e100b1', '402880eb5f24e5d3015f24f2cf260001', '402880eb5f24e5d3015f24f2cecf0000', '402880eb5f24e5d3015f24f5dc7104a0', '402880eb5f24e5d3015f24f5dc9d04a1', NULL, NULL, '402880eb5ef3599a015ef35ac3b00000', '2017-10-16 09:33:33', '625', '2017-10-16 09:33:33', 0, 0, '  ', 227, NULL, 0, '402880eb5f24e5d3015f24f56cf802ed', NULL),
