('402880eb5f24e5d3015f24f5e27804b9', 'Rua Elismar Diego Menegotto', '70', NULL, NULL, 'Residência bem localizada, com ótima orientação solar em todos os cômodos da casa, com 295 m² de área construída, em terreno de 14,00m x 35,00m ( 490 m² ) totalmente plano. \r\n\r\nA parte inferior é distribuída por sala de estar/jantar, cozinha, lavabo e área de serviço separada, com acesso para a área externa da casa. Ampla garagem de 6,00 m x 6,00 m.\r\nNa sala de estar portas de correr em PVC atendendo todas as exigências dos projetos de arquitetura contemporânea: Bom design, amplos vãos livres, vidros duplos, excelente vedação térmica, acústica e de água. \r\n\r\nEscada em granito, com acesso ao pavimento superior, com área de circulação, sala de estar, banheiro social, dois dormitórios com espera para Split, sacada aberta e posição solar Oeste. E o terceiro dormitório possui sacada aberta Leste, closet, suíte com hidromassagem e persianas automáticas. \r\n\r\nO projeto foi elaborado e construído com materiais de qualidade comprovada. A casa possui aquecimento solar, aberturas em PVC com vidros duplos e laminados , massa corrida e rebaixe em gesso em toda a casa, sanca na sala de estar e na suíte, corrimões em inox, duas caixas d’agua de dois mil litros cada. Porcelanato nos banheiros e na área de serviço e laminado na suíte e nas demais áreas. \r\n\r\nE para a segurança da família, muros altos com cerca elétrica, alarme e câmeras de segurança. \r\n\r\nNa parte externa, uma área de lazer para a família desfrutar de cada dia. \r\n', 'Ainda nÃ£o saiu o Abitse. \r\nPosiÃ§Ã£o Solar da frente da casa Oeste.', 1590000, 0, 0, 0, 2, 0, 1, 2, NULL, NULL, 0, '', '', NULL, '95700-000', NULL, NULL, NULL, 0, NULL, '', '402880eb5ef3599a015ef35ac3d10002', '402880eb5f24e5d3015f24f5e27804b8', '402880eb5f24e5d3015f24f5e23f04b7', '402880eb5f24e5d3015f24f5e1af04b4', '402880eb5f24e5d3015f24f2cf260001', '402880eb5f24e5d3015f24f2cecf0000', '402880eb5f24e5d3015f24f5e1d804b5', '402880eb5f24e5d3015f24