('402880eb5f24e5d3015f24f5f3f204fa', 'Rua Amadeo Postal', '136', NULL, NULL, 'Localizada em uma Região nobre e muito valorizada, no Bairro Santo Antão, aonde a tranquilidade é o fator número um para quem busca a calmaria.\r\n\r\nNotando a fachada principal, percebemos a belíssima criação com linhas amplas, elegância e sofisticação. Um projeto arquitetônico que buscou forma para compor um lar com perfeição buscando trazer conforto para a família. \r\n\r\nCom 339 m² de área construída, a parte inferior é composta por cozinha / sala de estar com lareira canadense em granito com aquecimento em todos os ambientes, uma segunda sala de estar com rebaixe em gesso e luzes de led, dois dormitórios, uma suíte com hidromassagem e banheiro social. Ainda temos a garagem para dois automóveis, lavabo, área de serviço e na parte dos fundos da casa, um pequeno jardim com quiosque equipado com churrasqueira e janelão de correr em vidro.\r\n\r\nPara acesso ao segundo pavimento, escada em madeira de Ipê, assim como em quase todos os ambientes da casa. Na parte superior, um ambiente para ser transformado naquilo que sua família deseja. Um escritório, uma academia, espaço para leitura, relaxamento ou descanso. \r\n\r\nOs detalhes externos da estrutura exibem elegância e detalhes criativos nos espaços de transição, ainda, com todo o charme da madeira de Ipê. \r\n \r\n\r\n', 'Casa mobilia, ficam mÃ³veis sob medida. Saem apenas eletros.\r\nDuas vagas internas de garagem, mas cabem mais tres carros na parte de fora da casa.\r\nSuÃ­te PS Oeste.\r\nDepÃ³sito com duas caixas d''agua , e um banheiro inacabÃ¡vel na parte superior. ', 1450000, 0, 0, 0, 2, 0, 1, 2, NULL, NULL, 1, '', '', NULL, '95700-000', NULL, NULL, NULL, 0, NULL, '', '402880eb5ef3599a015ef35ac3d10002', '402880eb5f24e5d3015f24f5f3f204f9', '402880eb5f24e5d3015f24f5f3a404f8', '402880eb5f24e5d3015f24f4e4e100b1', '402880eb5f24e5d3015f24f2cf260001', '402880eb5f24e5d3015f24f2cecf0000', '402880eb5f24e5d3015f24f5f36404f6', '402880eb5f24e5