('402880eb5f24e5d3015f24f658bd0682', 'Rua Bento Gonçalves', '2991', NULL, NULL, 'Update São Pelegrino. Um empreendimento diferenciado em cada detalhe. Localizado em um dos bairros mais tradicionais de Caxias do Sul, o Update tem um projeto arquitetônico contemporâneo. Alinhado à tendências internacionais, o Update traz soluções para a vida nas grandes cidades, seja por sua vasta estrutura compartilhada ou pelo serviço de gestão semelhante ao de um hotel.\r\n\r\nO segundo pavimento do Update será todo destinado à área de uso comum. São vinte e dois ambientes que ocupam mais de 900 metros quadrados, e será entregue com todos os espaços mobiliados, decorados, equipados, e com wifi gratuito, com muita comodidade para que as diversas tarefas possam ser realizadas no próprio prédio, sem a necessidade de deslocamento. Os ambientes da área comum são:\r\n\r\n* Espaço Gourmet, com capacidade para 42 pessoas sentadas + food service + parrilheira; \r\n* Terraço Gourmet; \r\n* Espaço Kids, com jogos, área de estudos, e serviço de recreacionista; \r\n* Playground;\r\n* Pub Gourmet, para 27 pessoas sentadas + chopeira + food service; \r\n* Sala de Cinema para 12 pessoas, com home theater, Netflix, frigobar, e micro-ondas; \r\n* Lavanderia Coletiva, com seis Lava e Seca, quatro tanques, living com wifi; \r\n* Book Space com jardim de inverno, dois living, e biblioteca; \r\n* Fitness funcional, com possibilidade de contratação de personal trainer;\r\n* Coworking; \r\n* Pet Care com banho, tosa, secagem, e possibilidade de contratação de Pet Services; \r\n* Pet Place com playground para os pets; \r\n* Game Space para dez pessoas, com videogame, poker, copa, bar, e TV; \r\n* Espaço do Chimarrão com água aquecida, no living externo; \r\n* Horta Orgânica para o cultivo de tempero e especiarias, para quem prioriza uma alimentação saudável;\r\n* Lounge do Fogo externo, com lareira; \r\n* Piscina Aquecida, com vestiários; \r\n* Solarium no terraço, com espreguiçadeiras e mesas; \r\n* Deck Molhado; \r\n* Gardem Relax com pergolados, sofás, e redes; \r\n* Bike Place com dez bicicletas, mais estacionamento para bicicletas; \r\n* Lobby luxuoso com toda contemporaneidade do empreendimento, com seu pé direito amplo e teto de vidro com Hub Café com máquinas de café, drinks, e lanches rápidos; \r\n\r\nRecepção com três elevadores. A segurança do Update terá circuito de câmeras de segurança, alarmes, portaria 24 horas com recepcionista, além de um gerente disponível 24 horas por dia. Revestimento das áreas comuns todo em porcelanato, iluminação com led, gerando maior economia, esquadrias em PVC com espera para vidros duplos, garantindo o conforto térmico e acústico. A gestão do condomínio será realizada por uma empresa especializada, a Othel Condomínios Inteligentes, e será possível reservar espaços ou contratar serviços adicionais, como camareiras, refeições prontas, serviço de motoboy, lavagem de carro, ligando para a portaria ou através do aplicativo da Othel. Dois andares de garagem, sendo uma vaga exclusiva para um carro que será compartilhado pelo condomínio (Car Sharing), e outra vaga exclusiva para lavagem de carro com aproveitamento de água da chuva (Car Washing). Também na garagem, espera para tomada específica para o fornecimento de energia para abastecimento de carros elétricos. \r\n\r\nO Update, seguindo a tendência de sustentabilidade contará com sistema fotovoltaico de captação solar, para auxiliar no consumo de energia nas áreas comuns. Apartamentos com pintura e massa corrida, gesso em todos os apartamentos, churrasqueira a carvão na maioria das unidades, plantas com opções de personalização, permitindo a união de mais de uma unidade, horizontalmente ou verticalmente (duplex). Com a união de mais de uma planta, pode-se chegar a três dormitórios. Todos os apartamentos com medidores de água individuais, espera para ar condicionado, automação básica (sistema de iluminação), e espera para automação geral. Acabamentos nos pisos em porcelanato e piso vinílico. O Update oferece também a possibilidade do comprador receber seu apartamento entregue mobiliado, decorado, e equipado. Studios a partir de 35 m² privativos, com uma vaga de garagem. Apartamentos com dois dormitórios, a partir de 50 m² privativos e possibilidade de duas vagas na garagem. Apartamentos de três dormitórios a partir de 105 m² privativos. Duplex com um dormitório, a partir de 70 m² privativos, com possibilidade de duas vagas na garagem. Duplex com dois dormitórios, a partir de 100 m² privativos e possibilidade de duas vagas na garagem. \r\n\r\nFinanciamento direto durante a obra, com entrada a partir de R$ 11.520,00 (apto 306), mensais a partir de R$ 480,00. Consulte demais condições.', 'Studios, Apartamentos de 1, 2, e 3 dormitÃ³rios, duplex de 1,e 2 dormitÃ³rios, vagas simples e duplas.', 0, 6, 0, 0, 0, 0, 0, 0, NULL, NULL, 1, '', '', NULL, '', NULL, NULL, NULL, 0, NULL, '', '402880eb5ef3599a015ef35ac3d10002', '402880eb5f24e5d3015f24f658bd0681', '402880eb5f24e5d3015f24f6588b0680', '402880eb5f24e5d3015f24f65824067d', '402880eb5f24e5d3015f24f523dc01b8', '402880eb5f24e5d3015f24f2cecf0000', '402880eb5f24e5d3015f24f65848067e', '402880eb5f24e5d3015f24f65864067f', NULL, NULL, '402880eb5ef3599a015ef35ac3b00000', '2017-10-16 09:34:05', '756', '2017-10-16 09:34:05', 0, 0, '  ', 321, NULL, 0, '402880eb5f24e5d3015f24f4bb190019', NULL),
