('402880eb5f24e5d3015f24f67de70715', 'Rua Estefânia Pasquali Eder com Dom José Barea', '', NULL, NULL, 'Lançamento de Alto Padrão. Em terreno de esquina, nasce um empreendimento de luxo, único. Seja bem-vindo ao Horizon, um empreendimento que chega para ser referência em estilo e sofisticação, e que vem marcar o mercado imobiliário da cidade como há muito tempo não se via igual. Tudo no Horizon foi pensado em seus mínimos detalhes, para que você tenha o máximo de conforto.\r\n\r\nA começar pelo endereço privilegiado, em plena junção das ruas Estefânia Pasquali com a Don José Barea, próximo de todas as facilidades e praticidade da vida moderna e, ao mesmo tempo, com tudo o que você precisa para se sentir bem.\r\n\r\nO acesso pelo hall decorado, a infraestrutura de qualidade superior, a amplitude dos apartamentos criam novos parâmetros para o segmento de alto padrão em Bento Gonçalves.\r\n\r\nCom a?rea privativa de 311,00m² por unidade, o Horizon é um empreendimento com o que ha? de mais requintado, moderno e conforta?vel em arquitetura residencial. São três amplas suítes, sendo a suíte Máster (36,37m2) com espaço para closet, banheiro do casal (14,19m2) com áreas íntimas separadas e banheira compartilhada; a suíte 2 com 26,83m2; e a suíte 3 com 22,12m2, todas com espaços para closet; a área social de 132m2 oferece um amplo espaço de lazer, reuniões de negócios mais reservadas, ou um jantar com seus convidados no suntuoso espaço gourmet (61,53m2) com cozinha, churrasqueira, e banheiro (4,27m2), ou na sala de estar e jantar integrados à cozinha (66,20m2); a área de serviço é ampla (9,88m2) e conta com um depósito de apoio (7,88m2); lavabo. Na garagem, possibilidade de até quatro vagas.\r\nDo alto do Horizon a vista revela o deslumbrante cenário da cidade. Um incrível overview da vida e do entretenimento urbano, do indescritível pôr do sol às luzes da noite bento gonçalvense.\r\n \r\nO Horizon contará com dois elevadores, sendo um de serviço; espera para lareira; espera para calefação; espera para automação dos apartamentos; esquadrias de PVC com vidros termoacústicos; salão de  festas mobiliado, integrado ao terraço; hall de entrada mobiliado; espaço de convívio e lazer; aproveitamento de água da chuva; gerador próprio de energia; guarita de segurança; sistema de monitoramento com câmeras.\r\n\r\n', '', 0, 0, 0, 439.93, 3, 0, 3, 3, NULL, NULL, 1, '', '', NULL, '', NULL, NULL, NULL, 2570.776, NULL, '', '402880eb5ef3599a015ef35ac3d10002', '402880eb5f24e5d3015f24f67de70714', '402880eb5f24e5d3015f24f67dad0713', '402880eb5f24e5d3015f24f4e62100b7', '402880eb5f24e5d3015f24f2cf260001', '402880eb5f24e5d3015f24f2cecf0000', '402880eb5f24e5d3015f24f67d550711', '402880eb5f24e5d3015f24f67d870712', NULL, NULL, '402880eb5ef3599a015ef35ac3b00000', '2017-10-16 09:34:14', '791', '2017-10-16 09:34:14', 0, 0, '  ', 350, NULL, 0, '402880eb5f24e5d3015f24f4b9550011', NULL),
('402880eb5f24e5d3015f24f67f38071a', 'Rua São Paulo', '125', NULL, NULL, 'Apartamento semi-mobiliado de um dormitório, com 52,66 m² privativos. Living com sacada integrada e churrasqueira, cozinha, área de serviço e banheiro social. Piso laminado na área íntima e piso cerâmico na área social. Ar condicionado tipo split no dormitório. Um box de garagem e depósito.\r\n\r\nLocalização privilegiada, próximo de farmácias, hospital, shopping, escolas e comércio de bens e serviços em geral.\r\n\r\nEdifício cercado, com elevador, porteiro eletrônico, cerca elétrica, hall de entrada, salão de festas mobiliado. Fachada com detalhes em pastilha cerâmica.', '', 212000, 0, 0, 0, 1, 0, 0, 1, NULL, NULL, 1, '', '', NULL, '', NULL, NULL, NULL, 0, NULL, '', '402880eb5ef3599a015ef35ac3d10002', '402880eb5f24e5d3015f24f67f380719', '402880eb5f24e5d3015f24f67ef90718', '402880eb5f24e5d3015f24f4d2b7006c', '402880eb5f24e5d3015f24f2cf260001', '402880eb5f24e5d3015f24f2cecf0000', '402880eb5f24e5d3015f24f67e930716', '402880eb5f24e5d3015f24f67edc0717', NULL, NULL, '402880eb5ef3599a015ef35ac3b00000', '2017-10-16 09:34:15', '793', '2017-10-16 09:34:15', 0, 0, '  ', 351, NULL, 0, '402880eb5f24e5d3015f24f4c1f50032', NULL),
