('402880eb5f24e5d3015f24f68cc90751', 'Rua Olavo Bilac', '1095', NULL, NULL, 'Três suítes com espera para split, uma suíte master com espaço para closet e banheiro com hidromassagem ( Norte ), living com três ambientes ( Oeste/Sul ) com lareira e churrasqueira, copa, cozinha com vídeo fone, área de serviço, despensa, banheiro auxiliar, gabinete ( Oeste ) com espera para split, entrada social e entrada de serviço, lavabo, espera para calefação, rebaixe em gesso, esquadrias PVC, laminado nos dormitórios e porcelanato nas de mais dependências.\r\nEdifício 100 % pastilhado com guarita de segurança 24 horas, dois elevadores sociais e um de serviço com código de segurança, dois apartamentos por andar, hall de entrada com pé direito duplo e câmeras de segurança em todos os espaços sociais do prédio. Salão de festas equipado e mobiliado com lareira, espaço interno para quarenta pessoas, televisão, ar condicionado, churrasqueira e banheiro com saída para o loung externo com forno, churrasqueira, lareira e pergolado. Brinquedoteca com saída para área externa com piscina adulto e infantil com deck de madeira, playground, quadra com grama sintética, piscina coberta aquecida, vestiário e banheiro. Fitness equipado e mobiliado com ar condicionado e banheiro masculino e feminino. Sala de jogos com mesa de sinuca e poker. Na garagem possui bicicletário. ', 'InfiltraÃ§Ã£o no gabinete, lareira sem acabamento, falta o rodapÃ© na parede Oeste da sala, furos na parede dos trÃªs dormitÃ³rios; ', 0, 0, 0, 0, 3, 0, 3, 0, NULL, NULL, 0, '', '', NULL, '95702-000', NULL, NULL, NULL, 0, NULL, '', '402880eb5ef3599a015ef35ac3d10002', '402880eb5f24e5d3015f24f68cc80750', '402880eb5f24e5d3015f24f68c9d074f', '402880eb5f24e5d3015f24f4bf6b0027', '402880eb5f24e5d3015f24f2cf260001', '402880eb5f24e5d3015f24f2cecf0000', '402880eb5f24e5d3015f24f68c5f074d', '402880eb5f24e5d3015f24f68c81074e', NULL, NULL, '402880eb5ef3599a015ef35ac3b00000', '2017-10-16 09:34:18', '806', '2017-10-16 09:34:18', 0, 0, '  ', 362,