('402880eb5f24e5d3015f24f691e10765', 'Rua Gaspar Cainelli', '309', NULL, NULL, 'Residência de alto padrão, com design contemporâneo, com 427,00m² bem distribuídos em dois pavimentos. No primeiro pavimento hall de entrada com pé direito duplo; lavabo; gabinete com móveis; circulação com armários embutidos; cozinha funcional e espaçosa, bem arejada e iluminada, com móveis planejados de forma a aproveitar bem o espaço sem comprometer a circulação, equipada com eletrodomésticos, portas de correr em vidro com acesso à área social; área de serviço com móveis e eletrodomésticos, pia em granito, e acesso independente para a parte externa; banheiro auxiliar; um suntuoso living para dois ambientes, com grandes aberturas com saída para os jardins, proporcionando uma bela vista do verde deixando o espaço atraente e aconchegante; lareira, mesa de jantar para oito serviços, móveis e estofados; sala do home theater equipada, em piso com desnível, com poltronas; espaço na garagem para dois veículos grandes, e ainda conta com espaço externo descoberto, para estacionamento, com portão de entrada independente. Ainda no living uma escadaria em madeira cercada por vidros dá acesso à parte superior. No segundo pavimento uma larga área de circulação com móveis; dois dormitórios com acesso entre eles por uma porta de correr; duas grandes suítes, ensolaradas, ambas com casas de banho, sendo a suíte máster com magnífico closet integrado à sala de banho e acesso privativo a um amplo terraço; banheiro social com banheira de hidromassagem, com duas cubas, sendo uma para crianças e dois vasos sanitários na mesma condição;  acesso ao segundo terraço (sul) com deck de madeira. Esta residência, de atmosfera tranquila, prática para a família, e confortável para receber amigos, conta com generosas aberturas em PVC com vidros duplos, teto com trabalho em gesso, iluminação embutida, piso parquet na área social e íntima, e piso porcelanato na cozinha e na área de serviço, espera para ar condicionado tipo split em todas as dependências, calefação a gás instalada em todas as dependências, móveis da marca Evviva, vídeo fone, acabamentos impecáveis, acessórios, pisos e revestimento da mais alta qualidade, aquecimento solar, sistema de segurança com interfone via câmera conectado à empresa de vigilância.\r\nA área externa é adorável. Construída em terreno de 840m2, a casa tem sua fachada com revestimento cerâmico da marca Gail, da Linha Loft Stones, com uma grande área lateral e nos fundos, cercada, gramada e iluminada.\r\n', 'Tour 360 - http://tour.vlcfotografia360.com.br/rudimarzini_01/\r\n\r\nConstruÃ§Ã£o de 2012.\r\nAceita imÃ³veis de menor valor.\r\nTodas propostas de valores menores serÃ£o analisadas pela proprietÃ¡ria.', 3000000, 0, 0, 0, 2, 0, 2, 2, NULL, NULL, 1, '-29.1923204', '-51.5041168', NULL, '95.702-706', NULL, NULL, NULL, 0, NULL, '67.487', '402880eb5ef3599a015ef35ac3d10002', '402880eb5f24e5d3015f24f691e10764', '402880eb5f24e5d3015f24f691bf0763', '402880eb5f24e5d3015f24f4e4e100b1', '402880eb5f24e5d3015f24f2cf260001', '402880eb5f24e5d3015f24f2cecf0000', '402880eb5f24e5d3015f24f6917a0761', '402880eb5f24e5d3015f24f691a00762', NULL, NULL, '402880eb5ef3599a015ef35ac3b00000', '2017-10-16 09:34:19', '811', '2017-10-16 09:34:19', 0, 0, '  ', 366, NULL, 0, '402880eb5f24e5d3015f24f4bb190019', NULL),
