('402880eb5f24e5d3015f24f6ac3107d2', 'Rua Presidente Castelo Branco', '334', NULL, NULL, 'Residência de alvenaria com 350m2 de área construída, em bairro nobre de Carlos Barbosa. Na parte inferior, hall de entrada decorado com papel de parede; lavabo; sala de estar com lareira; móvel sob medida, e amplas janelas para maior ventilação do ambiente; sala de jantar decorada com papel de parede; mesa para oito pessoas; piso tabuão; teto rebaixado em gesso com iluminação embutida; porta de correr para acesso à cozinha com móveis “Criare”, ilha central com fogão cooktop “Tramontina“, coifa, forno micro-ondas e forno elétrico embutidos, tampos em granito, mesa com quatro cadeiras, churrasqueira com bifeira; área de serviço; dependência para empregada ou despensa com móveis. Da cozinha o acesso à parte externa nos fundos se dá através de uma ampla sacada. \r\nJardim de inverno; escadas em granito com proteção em vidro, acesso à parte superior, com três dormitórios sendo uma suíte com sacada, closet, e banheiro com hidromassagem, ventilador de teto e móveis sob medida; segundo dormitório (oeste), mobiliado, com sacada; terceiro dormitório (norte) mobiliado, reversível para escritório; banheiro social.\r\nGaragem para dois veículos grandes, com cozinha americana equipada, churrasqueira rotativa, tampos em granito e depósito. \r\nNo subsolo um amplo depósito de 60 m², e um espaço para adega.\r\nTerreno de 24,00 x 30,00 cercado, com jardins, horta, pergolado, portão eletrônico para acesso à garagem. Casa com calefação a diesel em todas as dependências, vídeo fone, alarme, ar condicionado tipo split na suíte, telhas de concreto.\r\n\r\n*Os imóveis anunciados em nossa página são de propriedade de terceiros, e poderão sofrer alterações sem aviso prévio. \r\n\r\n \r\n', 'Casa tem 290 m2 averbados, e mais aproximadamente 60,00m2 nÃ£o estÃ£o averbados, correspondentes ao porÃ£o e ao espaÃ§o para adega.\r\nA casa tem um financiamento no Bradesco, que encerra em MarÃ§o de 2018.', 170000