('402880eb5f24e5d3015f24f6ad6807d8', 'Rua Giuseppe Santarosa', '0107', NULL, NULL, 'Casa de alvenaria com 48,00 m² localizada no Loteamento Social São Roque III. \r\n\r\nEm terreno de 32,50 m x 7,50 m, construção de dois pavimentos sendo na parte superior sala, cozinha, um dormitório com sacada aberta e ar condicionado, um dormitório simples e banheiro social. Piso cerâmico em todo o imóvel. Na parte inferior possibilidade de  construir peças para a casa ou fechar a garagem. Nos fundos um patio com piscina. Imóvel todo cercado e com portão eletrônico dianteiro para acesso de veículos. ', 'O imÃ³vel estÃ¡ desocupado. ProprietÃ¡rio reside em Caxias do Sul.\r\nO IPTU Ã© cobrado apenas sobre o terreno, a casa nÃ£o estÃ¡ sendo pago IPTU;\r\nO valor Ã© negociÃ¡vel, aceita-se veÃ­culo como forma de pagamento;', 296800, 0, 0, 0, 1, 0, 0, 2, NULL, NULL, 1, '', '', NULL, '95708-744', NULL, NULL, NULL, 0, NULL, '56.832 Terreno', '402880eb5ef3599a015ef35ac3d10002', '402880eb5f24e5d3015f24f6ad6807d7', '402880eb5f24e5d3015f24f6ad5107d6', '402880eb5f24e5d3015f24f6aced07d3', '402880eb5f24e5d3015f24f2cf260001', '402880eb5f24e5d3015f24f2cecf0000', '402880eb5f24e5d3015f24f6ad1407d4', '402880eb5f24e5d3015f24f6ad3407d5', NULL, NULL, '402880eb5ef3599a015ef35ac3b00000', '2017-10-16 09:34:26', '837', '2017-10-16 09:34:26', 0, 0, '  ', 388, NULL, 0, '402880eb5f24e5d3015f24f56cf802ed', NULL),
('402880eb5f24e5d3015f24f6aeb407dd', 'Rua Angelo Marcon', '105', NULL, NULL, 'Morar no São Roque é como morar no Centro da cidade. Um Bairro completo, com Faculdade, colégios, supermercados, fruteiras, Bancos, lotérica e um comércio diversificado. \r\n\r\nApartamento novo com 54,96 m² de área privativa, dois dormitórios ( Oeste ), living estar / jantar com sacada integrada, churrasqueira trabalhada em granito, cozinha, área de serviço independente, área de circulação e banheiro social. Piso laminado e porcelanato, água quente, rebaixe em gesso, espera para split na sala e medidores individuais. \r\n\r\nO Empreendimento: Fachada imponente com sacadas pastilhadas, esquadrias em alumínio, dois elevadores e vista privilegiada em todos os apartamentos. Um projeto ímpar, endereço único que une as facilidades e a qualidade de vida em um dos Bairros mais queridos de Bento Gonçalves.', 'IPTU ainda nÃ£o sabem pois nÃ£o pagaram nenhuma vez;\r\nNo condomÃ­nio vem a Ã¡gua e gÃ¡s, por tanto os medidores sÃ£o individuais;', 180200, 0, 0, 73.93, 0, 0, 0, 2, NULL, NULL, 1, '', '', NULL, '95708-506', NULL, NULL, NULL, 0, NULL, '', '402880eb5ef3599a015ef35ac3d10002', '402880eb5f24e5d3015f24f6aeb407dc', '402880eb5f24e5d3015f24f6ae8007db', '402880eb5f24e5d3015f24f4c127002d', '402880eb5f24e5d3015f24f2cf260001', '402880eb5f24e5d3015f24f2cecf0000', '402880eb5f24e5d3015f24f6ae3807d9', '402880eb5f24e5d3015f24f6ae6007da', NULL, NULL, '402880eb5ef3599a015ef35ac3b00000', '2017-10-16 09:34:27', '839', '2017-10-16 09:34:27', 0, 0, '  ', 389, NULL, 0, '402880eb5f24e5d3015f24f56cf802ed', NULL),
('402880eb5f24e5d3015f24f6afda07e2', 'Rua Angelo Marcon', '105', NULL, NULL, 'Salas comerciais são cada vez mais procuradas por investidores. Ao procurar imóveis, os investidores têm se deparado cada vez mais com boas oportunidades em salas comerciais. Elas têm conquistado cada vez mais espaço e público, já que são utilizadas por quase todos os tipos de profissionais que precisam de um local ou escritório. \r\n\r\nAo buscar por uma boa sala comercial para comprar e alugar, alguns pontos devem ser levados em consideração, como a localização, por exemplo. Profissionais preferem salas em bairros com boa infraestrutura. As estruturas de transporte e acesso também são de suma importância.\r\n\r\nBairro São Roque, região que vem crescendo cada vez mais com uma vasta infra estrutura: faculdade, colégio, bancos, lotérica, supermercados, fruteiras e um comércio diversificado. Sala comercial com 229,75 m² de área privativa, ampla, com dois banheiros, piso porcelanato, rebaixe em gesso e fachada em vidro. São duas vagas de estacionamento internas e quatro vagas externas exclusivas para seus clientes, garanta-os mais facilidade e comodidade.\r\n\r\nDeseja mais informações ? Solicite e agende uma visita. \r\n\r\n', 'Dois boxes de garagem internos 83 e 84 , e quatro vagas externas exclusivas para clientes; As vagas externas nÃ£o possuem matrÃ­culas;\r\nIPTU ainda nÃ£o tem ;', 0, 0, 0, 306.06, 6, 0, 0, 0, NULL, NULL, 1, '', '', NULL, '95708-506', NULL, NULL, NULL, 1475, NULL, '', '402880eb5ef3599a015ef35ac3d10002', '402880eb5f24e5d3015f24f6afda07e1', '402880eb5f24e5d3015f24f6afbc07e0', '402880eb5f24e5d3015f24f4c127002d', '402880eb5f24e5d3015f24f2cf260001', '402880eb5f24e5d3015f24f2cecf0000', '402880eb5f24e5d3015f24f6af5d07de', '402880eb5f24e5d3015f24f6af9707df', NULL, NULL, '402880eb5ef3599a015ef35ac3b00000', '2017-10-16 09:34:27', '840', '2017-10-16 09:34:27', 0, 0, '  ', 390, NULL, 0, '402880eb5f24e5d3015f24f56cf802ed', NULL),
('402880eb5f24e5d3015f24f6b10907e7', 'Rua Fernando Calegari', '700', NULL, NULL, 'Apartamento de dois dormitórios com 45,31 m² de área privativa, living estar com sacada aberta, cozinha, área de serviço e banheiro social com ventilação natural. Piso cerâmico em todos os ambientes e na parede da cozinha. Uma vaga de garagem.\r\nPróximo a colégio, fruteira, ponto de ônibus e com saída pelo Borgo ou Progresso. ', 'Ainda nÃ£o tem IPTU. PrÃ©dio novo.', 169600, 0, 0, 68.49, 1, 0, 0, 2, NULL, NULL, 1, '', '', NULL, '95705 124', NULL, NULL, NULL, 0, NULL, '71.062 e 70.685', '402880eb5ef3599a015ef35ac3d10002', '402880eb5f24e5d3015f24f6b10907e6', '402880eb5f24e5d3015f24f6b0e107e5', '402880eb5f24e5d3015f24f4d2b7006c', '402880eb5f24e5d3015f24f2cf260001', '402880eb5f24e5d3015f24f2cecf0000', '402880eb5f24e5d3015f24f6b09907e3', '402880eb5f24e5d3015f24f6b0c907e4', NULL, NULL, '402880eb5ef3599a015ef35ac3b00000', '2017-10-16 09:34:27', '841', '2017-10-16 09:34:27', 0, 0, '  ', 391, NULL, 0, '402880eb5f24e5d3015f24f56cf802ed', NULL),
('402880eb5f24e5d3015f24f6b23a07ec', 'Rua Góes Monteiro', '620', NULL, NULL, 'Apartamento com 66,28 m² privativos, dois dormitórios, sala de estar/jantar, cozinha, churrasqueira, área de serviço e banheiro social. Um box de garagem. Posição solar norte. \r\n\r\nQualidade de vida e funcionalidade ao seu alcance com a localização privilegiada e facilidade de acesso dentro da Cidade. Jardins internos e externos que embelezam a vida. Fachada contemporânea toda pastilhada. Amplas esquadrias com vista privilegiada da Cidade. O prédio conta salão de festas, dois elevadores sociais e rampa de acessibilidade.\r\n\r\nPrevisão estimada de entrega para Março 2019.', '', 296800, 0, 0, 0, 1, 0, 0, 2, NULL, NULL, 1, '', '', NULL, '', NULL, NULL, NULL, 0, NULL, '', '402880eb5ef3599a015ef35ac3d10002', '402880eb5f24e5d3015f24f6b23a07eb', '402880eb5f24e5d3015f24f6b21507ea', '402880eb5f24e5d3015f24f4c72e0046', '402880eb5f24e5d3015f24f2cf260001', '402880eb5f24e5d3015f24f2cecf0000', '402880eb5f24e5d3015f24f6b1c907e8', '402880eb5f24e5d3015f24f6b1f507e9', NULL, NULL, '402880eb5ef3599a015ef35ac3b00000', '2017-10-16 09:34:28', '842', '2017-10-16 09:34:28', 0, 0, '  ', 392, NULL, 0, '402880eb5f24e5d3015f24f4c1f50032', NULL),
('402880eb5f24e5d3015f24f6b39d07f1', 'Rua Ramiro Barcelos Esquina com a Rua Paraná', '', NULL, NULL, 'No Centro da cidade, apartamento novo com 125,10 m² de área privativa, três dormitórios sendo um suíte, o 2° dormitório com sacada fechada e o 3° dormitório simples, área de circulação, estar e jantar com sacada integrada ( Norte ) garantindo uma ótima insolação natural da luz do sol e uma melhor ventilação natural, cozinha americana com opção para cooktop ( Leste ), churrasqueira com bifeira, área de serviço independente, lavabo e banheiro social. Duas vagas de garagem.\r\n\r\nPiso laminado e porcelanato com acabamento diferenciado, espera para lareira, dutos para lareira de alto rendimento, espera para lareira italiana com Pellet, vidros duplos nos dormitórios, rebaixe em gesso em todo o apartamento, espera para fogão a lenha com serpentino, espera para ar condicionado tipo split na sala e dormitórios, boiler para água quente e tubulação para aquecimento de piso através de radiadores " calefação " .\r\n\r\nUm apartamento valorizado em localização, posição solar Norte / Leste, ótima ventilação natural e bem distribuído internamente. Prédio inteiramente pastilhado, hall de entrada com pé direito duplo, salão de festas montado e equipado, câmeras de segurança e portaria.', '', 833506.13, 0, 0, 163.36, 2, 0, 1, 2, NULL, NULL, 1, '', '', NULL, '95700-000', NULL, NULL, NULL, 0, NULL, '', '402880eb5ef3599a015ef35ac3d10002', '402880eb5f24e5d3015f24f6b39d07f0', '402880eb5f24e5d3015f24f6b37007ef', '402880eb5f24e5d3015f24f4e62100b7', '402880eb5f24e5d3015f24f2cf260001', '402880eb5f24e5d3015f24f2cecf0000', '402880eb5f24e5d3015f24f6b32107ed', '402880eb5f24e5d3015f24f6b34b07ee', NULL, NULL, '402880eb5ef3599a015ef35ac3b00000', '2017-10-16 09:34:28', '843', '2017-10-16 09:34:28', 0, 0, '  ', 393, NULL, 0, '402880eb5f24e5d3015f24f56cf802ed', NULL),
('402880eb5f24e5d3015f24f6b50007f6', 'Rua Angelo Salton ', '134', NULL, NULL, 'Apartamento com 61,22 m² de área privativa, primeiro dormitório (posição solar leste) e o segundo dormitório (posição solar norte), área de circulação, living estar / jantar com sacada integrada (posição solar leste), churrasqueira, cozinha e área de serviço (posição solar leste). \r\n\r\nPiso laminado na área íntima e piso porcelanato na área social. Rebaixe em gesso e esquadrias em alumínio. Duas vagas de garagem. \r\n\r\nMedidores luz e gás, água sistema de rateio coletivo. \r\n\r\nApartamento Semi Mobiliado, permanece exatamente como nas fotos.', '', 360000, 0, 0, 98.42, 2, 0, 0, 2, NULL, NULL, 1, '', '', NULL, '95700-000', NULL, NULL, NULL, 0, NULL, '', '402880eb5ef3599a015ef35ac3d10002', '402880eb5f24e5d3015f24f6b50007f5', '402880eb5f24e5d3015f24f6b4dd07f4', '402880eb5f24e5d3015f24f4c2bf0035', '402880eb5f24e5d3015f24f2cf260001', '402880eb5f24e5d3015f24f2cecf0000', '402880eb5f24e5d3015f24f6b48d07f2', '402880eb5f24e5d3015f24f6b4bd07f3', NULL, NULL, '402880eb5ef3599a015ef35ac3b00000', '2017-10-16 09:34:28', '844', '2017-10-16 09:34:28', 0, 0, '  ', 394, NULL, 0, '402880eb5f24e5d3015f24f4b9550011', NULL),
