('402880eb5f24e5d3015f24f6b8950806', 'Rua Doutor Carlos Flores', '', NULL, NULL, 'Espaço ideal para uma vida plena, confortável, onde se cultive amor e bom humor, que incorpore a beleza e a funcionalidade em um só lugar.\r\n\r\nConheça o Ágape! Somente um apartamento por andar com área privativa de 272,16 m², 03 suítes, amplo living estar/jantar, cozinha, área de serviço, lavabo e duas vagas de garagem (com possibilidade de adquirir mais vagas). Sacadas abertas em todos os ambientes e piscina individual aquecida no living.\r\n\r\nRevestimentos em porcelanato e vinílico, lareira a pellet italiana já instalada, sistema de automação e acesso com reconhecimento facial já instalado, liberdade para modificações na planta do apartamento com possibilidade de até 5 suítes com closet, elevador social e serviço codificados, esquadrias em PVC com vidros termoacústicos e brises em madeira, churrasqueira com bifeira já instalado, manta acústica entre lajes.', '', 0, 0, 0, 404.54, 2, 0, 3, 0, NULL, NULL, 0, '', '', NULL, '95703-158', NULL, NULL, NULL, 2343.79, NULL, '', '402880eb5ef3599a015ef35ac3d10002', '402880eb5f24e5d3015f24f6b8950805', '402880eb5f24e5d3015f24f6b8800804', '402880eb5f24e5d3015f24f4bf6b0027', '402880eb5f24e5d3015f24f2cf260001', '402880eb5f24e5d3015f24f2cecf0000', '402880eb5f24e5d3015f24f6b8380802', '402880eb5f24e5d3015f24f6b8650803', NULL, NULL, '402880eb5ef3599a015ef35ac3b00000', '2017-10-16 09:34:29', '847', '2017-10-16 09:34:29', 0, 0, '  ', 397, NULL, 0, '402880eb5f24e5d3015f24f56a5902e1', NULL),
